(1332, 'frm_inbox_cache', 'a:3:{s:7:\"timeout\";i:1671805602;s:5:\"value\";s:3054:\"[{\"key\":\"videos\",\"subject\":\"Did you know?\",\"message\":\"There\'s a growing collection of great video tutorials ready for you! Have a request? Let us know! Don\'t forget to subscribe so you\'ll hear about new videos too.\",\"cta\":\"<a href=\\\"https:\\/\\/formidableforms.com\\/knowledgebase\\/latest-videos\\/?utm_source=WordPress&utm_medium=inbox&utm_campaign=liteplugin&utm_content=videos\\\" class=\\\"button-primary frm-button-primary\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">Learn More<\\/a> <a href=\\\"#\\\" class=\\\"button-secondary frm-button-secondary frm_inbox_dismiss\\\">Dismiss<\\/a>\",\"icon\":\"frm_support_icon\",\"starts\":\"\",\"type\":\"news\",\"who\":[\"all\"]},{\"key\":\"acf-announcement-business-elite\",\"subject\":\"&#91;New] Introducing ACF Forms!\",\"message\":\"We\'ve got another new one for you :-) Many of our users have asked for a way to update\\/edit Advanced Custom Fields using a Formidable Form. So we made a new ACF Forms Add-on! This allows for any ACF fields to be updated from a front-end form (with no need for any coding whatsoever). If you\'ve set up your site with Advanced Custom Fields, this could be a game changer. It even works with Pro ACF fields like repeaters. And guess what? This feature is included in your Formidable plan. All you need to do is download and install the add-on. Happy Holidays!\",\"cta\":\"<a href=\\\"https:\\/\\/formidableforms.com\\/features\\/acf-form-builder\\/?utm_source=WordPress&utm_medium=inbox&utm_campaign=liteplugin&utm_content=acf-announcement-business-elite\\\" class=\\\"button-primary frm-button-primary\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">Learn More<\\/a> <a href=\\\"#\\\" class=\\\"button-secondary frm-button-secondary frm_inbox_dismiss\\\">Dismiss<\\/a>\",\"icon\":\"frm_smile_icon\",\"starts\":1670889600,\"expires\":1672444800,\"type\":\"news\",\"who\":[\"business\",\"elite\"],\"banner\":\"Effortlessly map form fields to ACF fields.\"},{\"key\":\"acf-announcement-free-basic-plus-expired\",\"subject\":\"&#91;New] Introducing ACF Forms!\",\"message\":\"Hey! We\'ve got a brand new feature you might like :-) Ever heard of Advanced Custom Fields (ACF)? Many of our users have asked for a way to update\\/edit ACF fields using a Formidable Form. So we made a new ACF Forms Add-on! This allows for any ACF fields to be updated from a front-end form (with no need for any coding whatsoever). It even works with Pro ACF fields like repeaters. All you need to get started is found in our Business &amp; higher plan. Just download and install the add-on, and you are set!\",\"cta\":\"<a href=\\\"https:\\/\\/formidableforms.com\\/features\\/acf-form-builder\\/?utm_source=WordPress&utm_medium=inbox&utm_campaign=liteplugin&utm_content=acf-announcement-free-basic-plus-expired\\\" class=\\\"button-primary frm-button-primary\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">Learn More<\\/a> <a href=\\\"#\\\" class=\\\"button-secondary frm-button-secondary frm_inbox_dismiss\\\">Dismiss<\\/a>\",\"icon\":\"frm_smile_icon\",\"starts\":1670889600,\"expires\":1672444800,\"type\":\"news\",\"who\":[\"free\",\"basic\",\"personal\",\"grandfathered\",\"expired\"],\"banner\":\"Effortlessly map form fields to ACF fields.\"}]\";s:7:\"version\";s:5:\"5.5.5\";}', 'no'),
