(1346, 'frm_addons_l', 'a:3:{s:7:\"timeout\";i:1671738693;s:5:\"value\";s:116990:\"{\"28158728\":{\"title\":\"ACF Forms\",\"name\":\"ACF Forms\",\"display_name\":\"ACF Forms\",\"slug\":\"acf-forms\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/acf\\/formidable-acf-1.0.zip\"],\"excerpt\":\"Sync custom fields between Formidable and Advanced Custom Fields or ACF Pro.\",\"id\":28158728,\"released\":\"2022-12-13 00:00:00\",\"categories\":[\"Business\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/acf-form\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/acf-forms\\/\",\"changelog\":\"<p>No Changes Found<\\/p>\\n\",\"plugin\":\"formidable-acf\\/formidable-acf.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"advanced, custom fields\"},\"20790298\":{\"title\":\"Active Campaign\",\"name\":\"Active Campaign\",\"display_name\":\"ActiveCampaign\",\"slug\":\"activecampaign-wordpress-plugin\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/activecampaign\\/formidable-activecampaign-1.08.zip\"],\"excerpt\":\"Add contacts to any ActiveCampaign list from your WordPress forms.\",\"id\":20790298,\"released\":\"2018-07-05 00:00:00\",\"categories\":[\"Elite\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/activecampaign-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/activecampaign-wordpress-plugin\\/\",\"changelog\":\"<h4>v1.08 - June 16, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to ActiveCampaign.<\\/li>\\n<li>Fix: Errors messages were not displaying properly in settings when an ActiveCampaign trial had expired.<\\/li>\\n<li>Fix: Nothing would get sent when a user id field was set to something other than a name or email option.<\\/li>\\n<\\/ul>\\n<h4>v1.07 - April 12, 2021<\\/h4>\\n<p>- Fix: Contacts were not always properly being resubscribed after unsubscribing, even when the resubscribe checkbox was checked.<br \\/>\\n- Fix: Properly send data as an array when sending data to a custom Active Campaign Checkbox field.<br \\/>\\n- Fix: Only send the file url to Active Campaign instead of the HTML display value when a file field is set.<\\/p>\\n<h4>v1.06.01 - November 3, 2020<\\/h4>\\n<ul>\\n<li>Fix: Keep the \\\"resubscribe\\\" box checked<\\/li>\\n<li>Remove the recently added Custom Automation option for opt-in since you can\'t build an automation for unconfirmed users<\\/li>\\n<\\/ul>\\n<h4>v1.06 - August 7, 2020<\\/h4>\\n<ul>\\n<li>New: Select an AC form for double opt-in<\\/li>\\n<li>New: Add option to resubscribe a contact instead of forcing it. By default, contacts will not be resubscribed.<\\/li>\\n<li>New: When a contact is updated, don\'t remove them from other lists they are on.<\\/li>\\n<li>New: Update the contact when email is changed instead of creating a new contact.<\\/li>\\n<li>Cleanup global settings and form action settings.<\\/li>\\n<li>Removed unused hidden fields in the form.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - April 15, 2019<\\/h4>\\n<ul>\\n<li>Fix the icon used to create an ActiveCampaign action.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-activecampaign\\/formidable-activecampaign.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"ActiveCampaign\"},\"28123670\":{\"title\":\"Application Shortcuts\",\"name\":\"Application Shortcuts\",\"display_name\":\"Application Shortcuts\",\"slug\":\"application-shortcuts\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28123670,\"released\":\"2022-05-02 13:38:05\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/application-shortcuts\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"337527\":{\"title\":\"Authorize.net AIM\",\"name\":\"Authorize.net AIM\",\"display_name\":\"Authorize.net AIM\",\"slug\":\"authorize-net-aim\",\"version\":\"2.02\",\"new_version\":\"2.02\",\"location\":[\"fp.strategy11.com\\/releases\\/authorize-net\\/formidable-authorize-net-2.02.zip\"],\"excerpt\":\"Accept one-time payments directly on your site, using Authorize.net AIM.\",\"id\":337527,\"released\":\"2016-04-29 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/authorize-net-aim\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/authorize-net-aim\\/\",\"changelog\":\"<h4>v2.02 - March 7, 2022<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to Authorize.net.<\\/li>\\n<li>New: Set the default currency to the one selected in global settings.<\\/li>\\n<li>New: Added additional currencies from Pro.<\\/li>\\n<li>Fix: Payments would not work if the amount specified was formatted as currency.<\\/li>\\n<li>Fix: Prevent a fatal error that happens in PHP8 when filling payment information.<\\/li>\\n<li>Fix: Expire dates were not properly calculating.<\\/li>\\n<li>Fix: Some echecks were not getting approved.<\\/li>\\n<li>Fix: Updated incorrect text domains.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - March 18, 2019<\\/h4>\\n<ul>\\n<li>Fix: Increase the timeout for creating the payment on Authorize.net in order to prevent false failures.<\\/li>\\n<li>Save the full API response in the log instead of only the body of the response for more helpful debugging messages.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - February 25, 2019<\\/h4>\\n<ul>\\n<li>Requires Formidable 3.0+ and WordPress 4.7+<\\/li>\\n<li>New: Remove the Authorize.net SDK. This greatly reduces the size of the plugin, and resolves PHP 7.0+ compatibility issues.<\\/li>\\n<li>New: Use Webhooks to get notifications from Authorize.net to a REST endpoint when a payment status changes. This includes refunds, voids, and completed transactions. A webhook will be automatically created when the Formidable -&gt; Global settings page is saved.<\\/li>\\n<li>New: Added signature key to Global settings page and removed the Silent Post url. This is used to verify any incoming webhooks.<\\/li>\\n<li>New: Don\'t use MD5 verification, but meet the new sha512 requirement instead.<\\/li>\\n<li>New: Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: Replace usage of deprecated file and functions from Formidable<\\/li>\\n<li>Fix: Added escaping for translatable strings.<\\/li>\\n<\\/ul>\\n<h4>v1.02 - August 31, 2018<\\/h4>\\n<ul>\\n<li>New: Delete entries that don\'t pass credit card validation<\\/li>\\n<li>New: Process shortcodes in the payment amount, description, and actions after payment. This includes default values, field values, and regular WP shortcodes.<\\/li>\\n<li>New: Allow the api key to be overridden with constants. The Authorize account can be set with AUTHORIZENET_TRANSACTION_KEY and AUTHORIZENET_API_LOGIN_ID<\\/li>\\n<li>New: Disable live mode for non-ssl sites. Show the settings and always allow test mode.<\\/li>\\n<li>New: Add option to register user after successful payment<\\/li>\\n<li>New: Add payment triggers to api action<\\/li>\\n<li>New: Add receipt ID shortcode<\\/li>\\n<li>New: Add Pakistani rupee, Chinese Renminbi Yuan, South African Rand, and Sri Lankan Rupee to currency options<\\/li>\\n<li>New: If PayPal is also installed, show the PayPal payment completed status<\\/li>\\n<li>New: Add frm_pay_[payment type]_sidebar hook for adding content to the sidebar of a single payment<\\/li>\\n<li>Fix: Include the customer info with an echeck. Show the address fields in eCheck settings. When only eCheck is selected, the extra fields were not set to show or send to Authnet<\\/li>\\n<li>Fix: Replace the included SSL cert since it is causing errors on some servers<\\/li>\\n<li>Fix: Filter description shortcodes on subscriptions page<\\/li>\\n<li>Fix: Create the post (if applicable) before fields are updated<\\/li>\\n<li>Fix: Use credit card icon instead of Stripe. This will show in 3.0.<\\/li>\\n<li>Fix: Update the gateway field for better 3.0 compatibility<\\/li>\\n<\\/ul>\\n<h4>v1.01 - December 12, 2016<\\/h4>\\n<ul>\\n<li>Prevent errors when Formidable is deactivated<\\/li>\\n<li>Add frm_authnet_invoice_num hook for setting the invoice number<\\/li>\\n<li>Add a link to view the subscriptions<\\/li>\\n<li>If the subscription has failed &gt; 3 times, set it to canceled<\\/li>\\n<li>Show more error messages to a user when the payment fails<\\/li>\\n<li>Remove plugin header for nested plugin to prevent error message when activating from the plugins upload page<\\/li>\\n<li>Use the correct currency for the total on the entry sidebar instead of defaulting to USD<\\/li>\\n<li>Allow field shortcodes in description<\\/li>\\n<li>Add Indian Rupee to currency options<\\/li>\\n<li>Add table headings and subscription description to the frm-subscriptions shortcode<\\/li>\\n<li>Prevent field ids from being used as the amount<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-authorize-net\\/formidable-authorize-net.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"Authorize.net\"},\"168468\":{\"title\":\"AWeber\",\"name\":\"AWeber\",\"display_name\":\"AWeber\",\"slug\":\"aweber\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-aweber\\/formidable-aweber-2.03.zip\"],\"excerpt\":\"AWeber is a powerful email marketing service. Subscribe contacts to an AWeber mailing list when they submit your WordPress contact forms.\",\"id\":168468,\"released\":\"2013-11-26 00:00:00\",\"categories\":[\"Creator\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-aweber\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/aweber\\/\",\"changelog\":\"<h4>v2.03 - March 3, 2022<\\/h4>\\n<ul>\\n<li>New: Subscription errors and successful subscriptions will now be logged if the Formidable Logs add on is available.<\\/li>\\n<li>Fix: Accents will now be removed from characters when subscribing to avoid issues with special accented characters breaking in names in AWeber.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - October 14, 2020<\\/h4>\\n<ul>\\n<li>New: Add comma separated tags to your AWeber actions<\\/li>\\n<li>New: Add an ad tracking category to your AWeber actions<\\/li>\\n<li>New: Improved plugin security<\\/li>\\n<li>New: Updated the icon for AWeber in settings<\\/li>\\n<li>Fix: Support PHP 7+<\\/li>\\n<li>Fix: Add download id for more autoupdating<\\/li>\\n<li>Code: Removed Formidable &lt; v2.0 fallbacks. This version will not work with a Formidable version below 2.0.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - February 4, 2016<\\/h4>\\n<ul>\\n<li>Make sure the update notice doesn\'t show if the plugin is up to date<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 15, 2016<\\/h4>\\n<ul>\\n<li>Move the AWeber settings into a form action<\\/li>\\n<li>Make the plugin translatable<\\/li>\\n<li>Now it works with the free version of Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.0.03 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when Formidable is disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-aweber\\/formidable-aweber.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"168463\":{\"title\":\"Bootstrap\",\"name\":\"Bootstrap\",\"display_name\":\"Bootstrap\",\"slug\":\"bootstrap\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-bootstrap\\/formidable-bootstrap-1.03.zip\"],\"excerpt\":\"Instantly add Bootstrap styling to all your Formidable forms.\",\"id\":168463,\"released\":\"2014-08-05 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-bootstrap\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap\\/\",\"changelog\":\"<h4>vv1.03 - January 18, 2021<\\/h4>\\n<ul>\\n<li>This update requires action. After updating, click the link to migrate the old settings.<strong> If you save a form with Bootstrap field options before running this migration, you risk losing those settings.<\\/strong><\\/li>\\n<li>New: Moved Prepend and Append Bootstrap field options to Before Input and After Input.<\\/li>\\n<li>New: Errors are now shown by default and can no longer be turned off<\\/li>\\n<li>New: Improved plugin security<\\/li>\\n<li>New: Added bootstrap CSS file directly into plugin for GDPR compliance<\\/li>\\n<\\/ul>\\n<h4>v1.02.02 - October 9, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Allow prepend and append options with dropdowns.<\\/li>\\n<\\/ul>\\n<h4>v1.02.01 - March 8, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Update Bootstrap version to 3.3.7.<\\/li>\\n<li>Enhancement: Add prepend and append options to Lookup &gt; Text fields<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 13, 2016<\\/h4>\\n<ul>\\n<li>Enhancement: Update Bootstrap version to 3.3.6.<\\/li>\\n<li>Fix: Make sure modified [input] tag works well with Bootstrap append.<\\/li>\\n<li>Fix: Add Bootstrap ID so automatic updates work in the future.<\\/li>\\n<li>Fix: Make sure Lookup checkbox and radio fields look nice.<\\/li>\\n<\\/ul>\\n<h4>v1.01.04 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors with Formidable disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-bootstrap\\/formidable-bootstrap.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"185013\":{\"title\":\"Bootstrap Modal\",\"name\":\"Bootstrap Modal\",\"display_name\":\"Bootstrap Modal\",\"slug\":\"bootstrap-modal\",\"version\":\"2.0\",\"new_version\":\"2.0\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-modal\\/formidable-modal-2.0.zip\"],\"excerpt\":\"Open forms, views, other shortcodes, or sections of content in a Bootstrap popup.\",\"id\":185013,\"released\":\"2015-08-26 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/bootstrap-modal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap-modal\\/\",\"changelog\":\"<h4>v2.0 - August 21, 2017<\\/h4>\\n<ul>\\n<li>Add a new shortcode format for more flexibility. Now you can include whatever you\'d like in the modal.<br \\/>\\n[ frmmodal-content]content here[\\/frmmodal-content]<\\/li>\\n<li>Add frm_modal_shortcode action hook. This is for triggering external scripts that are loaded too late when they aren\'t triggered until the footer.<\\/li>\\n<li>Add modal_class shortcode option. This will add a class to the generated modal.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - April 4, 2016<\\/h4>\\n<ul>\\n<li>Allow size=small or size=large to change the modal size<\\/li>\\n<li>Add modal_title parameter to the shortcode<\\/li>\\n<li>Make sure modal works when no forms are present on the page<\\/li>\\n<li>Fix plugin URI<\\/li>\\n<\\/ul>\\n<h4>v1.03 - January 18, 2016<\\/h4>\\n<ul>\\n<li>Make sure multiple modals on a page work correctly<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 17, 2015<\\/h4>\\n<ul>\\n<li>Show an icon to close the modal<\\/li>\\n<li>Allow any shortcode to be used for the modal content. For example, use [ frmmodal type=\\\"frm-login\\\" label=\\\"Login\\\"] to show a login form when the registration plugin is active.<\\/li>\\n<li>When the license number is saved, make sure it\'s for the correct plugin<\\/li>\\n<\\/ul>\\n<h4>v1.01 - November 24, 2015<\\/h4>\\n<ul>\\n<li>Allow classes to be added to the modal link. [ frmmodal id=5 label=\\\"click here\\\" class=\\\"your classes here\\\"]<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-modal\\/formidable-modal.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"modal, popup\"},\"28144089\":{\"title\":\"Business Directory\",\"name\":\"Business Directory\",\"display_name\":\"Business Directory\",\"slug\":\"business-directory\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28144089,\"released\":\"2022-08-24 16:41:02\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/business-directory\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28123666\":{\"title\":\"Business Hours\",\"name\":\"Business Hours\",\"display_name\":\"Business Hours\",\"slug\":\"business-hours\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28123666,\"released\":\"2022-05-02 13:25:15\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/business-hours\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"20891694\":{\"title\":\"Campaign Monitor\",\"name\":\"Campaign Monitor\",\"display_name\":\"Campaign Monitor\",\"slug\":\"campaign-monitor\",\"version\":\"1.04\",\"new_version\":\"1.04\",\"location\":[\"fp.strategy11.com\\/releases\\/campaign-monitor\\/formidable-campaignmonitor-1.04.zip\"],\"excerpt\":\"Save time by automatically sending leads from WordPress forms to Campaign Monitor.\",\"id\":20891694,\"released\":\"2019-06-17 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"\\/knowledgebase\\/campaign-monitor-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/campaign-monitor\\/\",\"changelog\":\"<h4>v1.04 - June 23, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to Campaign Monitor.<\\/li>\\n<li>Fix: Nothing would get sent when a user id field was set to something other than a name or email option.<\\/li>\\n<li>Fix: Prevent a fatal error that happens in PHP8 after trying to save Campaign Monitor API keys.<\\/li>\\n<li>Fix: Prevent a fatal error that happens in PHP8 after trying to load the fields for a specific contact list.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-campaignmonitor\\/formidable-campaignmonitor.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"20826884\":{\"title\":\"Constant Contact\",\"name\":\"Constant Contact\",\"display_name\":\"Constant Contact\",\"slug\":\"constant-contact\",\"version\":\"1.04\",\"new_version\":\"1.04\",\"location\":[\"fp.strategy11.com\\/releases\\/constant-contact\\/formidable-constantcontact-1.04.zip\"],\"excerpt\":\"Setup WordPress forms to create leads automatically in Constant Contact. Just select a list and match up form fields.\",\"id\":20826884,\"released\":\"2018-10-15 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"\\/knowledgebase\\/constant-contact-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/constant-contact\\/\",\"changelog\":\"<h4>v1.04 - June 22, 2022<\\/h4>\\n<ul>\\n<li>New: Updated the Authorization service for Constant Contact. Please re-connect as soon as possible to the new service to ensure that your connection does not break in the future when the old service is removed.<\\/li>\\n<li>Fix: Refresh tokens would become expired and break connections when trying to use the same Constant Contact account with multiple websites.<\\/li>\\n<li>Fix: A 409 error was getting triggered when sending an email to multiple lists with a single form submission throwing an error that the email already exists for the contact.<\\/li>\\n<\\/ul>\\n<h4>v1.03 - September 9, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to Constant Contact.<\\/li>\\n<li>Fix: Nothing would get sent when a user id field was set to something other than a name or email option.<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 12, 2019<\\/h4>\\n<ul>\\n<li>New: Make authenticating easier<\\/li>\\n<li>Show more helpful error messages in the global settings and in the form action<\\/li>\\n<li>Use icon instead of image for form action<\\/li>\\n<li>Update form action layout to match v4.0<\\/li>\\n<li>Remove debug mode in favor of logging<\\/li>\\n<li>Fix: When different forms are used to update a contact, only the most recent info was saved and previous values were removed (ie custom fields, selected lists)<\\/li>\\n<li>Fix: If a contact was deleted in Constant Contact, it was causing a failure when updating the contact from Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.01 - October 31, 2018<\\/h4>\\n<ul>\\n<li>Fix: On first install, the Global settings page was not loaded correctly<\\/li>\\n<li>Fix: Allow the debug mode checkbox to be unchecked<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-constantcontact\\/formidable-constantcontact.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28100793\":{\"title\":\"Conversational Forms\",\"name\":\"Conversational Forms\",\"display_name\":\"Conversational Forms\",\"slug\":\"conversational-forms\",\"version\":\"1.0.03\",\"new_version\":\"1.0.03\",\"location\":[\"fp.strategy11.com\\/releases\\/chat\\/formidable-chat-1.0.03.zip\"],\"excerpt\":\"Ask one question at a time to humanize forms and boost their conversion rates.\",\"id\":28100793,\"released\":\"2022-01-25 00:00:00\",\"categories\":[\"Business\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/conversational-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/conversational-forms\\/\",\"changelog\":\"<h4>v1.0.03 - December 6, 2022<\\/h4>\\n<ul>\\n<li>New: Stripe payment element fields used for Stripe link will now be counted in conversational progress bars.<\\/li>\\n<li>New: Updated how the conversational Lines style is assigned to improve compatibility with the Stripe Appearance API used for Stripe link payment elements.<\\/li>\\n<li>New: Added additional button styles for conversational navigation buttons.<\\/li>\\n<li>Fix: An inline datepicker would cause a conversational form to break.<\\/li>\\n<li>Fix: Prevent overflowing borders from getting cut in conversational forms.<\\/li>\\n<li>Fix: Prevent a \\\"state.activeForm.querySelector is not a function\\\" JavaScript error when a page loads with no forms available that can happen when using modals.<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - August 1, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new \\\"Show start page\\\" toggle to conversational form settings to make it easier to enable and disable than before.<\\/li>\\n<li>Fix: Some conversational forms were breaking on some servers, including forms in Elementor pop ups, with an error stating that the get_plugin_data function does not exist.<\\/li>\\n<\\/ul>\\n<h4>v1.0.01 - March 16, 2022<\\/h4>\\n<ul>\\n<li>New: Section titles and descriptions will now be shown as a separate question in a conversational form, displayed as field labels. When moving between fields in a section a section heading will be shown with each row.<\\/li>\\n<li>New: Conversational start pages will no longer be displayed if the title and description are both hidden in the conversational form.<\\/li>\\n<li>Fix: Conversational forms would always display a title or description even if the title=false and description=false options were set.<\\/li>\\n<li>Fix: Improved support for loading multiple conversational forms with API embedded script tags.<\\/li>\\n<li>Fix: Automatic focusing on page load will now only happen in conversational forms on landing pages and on preview pages to prevent issues with forms getting focused in the middle of a long page.<\\/li>\\n<li>Fix: Conditional logic on submit buttons was occasionally not working as expected when the \\\"Hide submit button\\\" option was used.<\\/li>\\n<li>Fix: Sections with label positions set to a value other than top were triggering a breaking error.<\\/li>\\n<li>Fix: Fixed a conflict with the Twenty Twenty theme that was causing the press enter icon to appear in the wrong position in the page.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-chat\\/formidable-chat.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"20247260\":{\"title\":\"Datepicker Options\",\"name\":\"Datepicker Options\",\"display_name\":\"Datepicker Options\",\"slug\":\"datepicker-options\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/dates\\/formidable-dates-1.06.zip\"],\"excerpt\":\"Add more options to date fields in your forms for so only the dates you choose can be chosen.\",\"id\":20247260,\"released\":\"2018-07-30 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/datepicker-options\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/datepicker-options\\/\",\"changelog\":\"<h4>v1.06 - September 26, 2022<\\/h4>\\n<ul>\\n<li>New: Date pickers initialized using advanced Datepicker options add on will now use a prefixed class to avoid styling conflicts with other date pickers. This will help improve how month and year dropdowns appear for inline datepickers with the Astra theme on WooCommerce pages.<\\/li>\\n<li>Fix: Inline datepickers were getting stuck in an infinite loop and causing performance issues when using date formats that don\'t easily work with JavaScript.<\\/li>\\n<li>Fix: Date validation was failing for Minimum and Maximum rules that used upper case characters in the offset like + Days.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - May 26, 2022<\\/h4>\\n<ul>\\n<li>New: Date field values will now be cleared on load for new entries when the value is not on an included day of the week, is set as a blackout date, or goes beyond the minimum or maximum date.<\\/li>\\n<li>New: Added more date field validation so submissions will be blocked with an error when submitting a date that is not on an included day of the week, is set as a blackout date, or goes beyond the minimum or maximum date.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - January 3, 2022<\\/h4>\\n<ul>\\n<li>Fix: Date fields were breaking when the unique option was set and an add on option was also set (such as blackout dates or inline date picker).<\\/li>\\n<li>Fix: Inline date pickers would default to today when no default value was set.<\\/li>\\n<\\/ul>\\n<h4>v1.03 - March 8, 2021<\\/h4>\\n<ul>\\n<li>Fix: Date pickers were breaking inside repeaters.<\\/li>\\n<li>Fix: Prevent a warning that was appearing when importing forms with date values.<\\/li>\\n<li>Fix: Prevent a warning when formidable free is not active.<\\/li>\\n<\\/ul>\\n<h4>v1.02 - February 15, 2021<\\/h4>\\n<ul>\\n<li>Fix: Inline date pickers would cause an infinite loop for most date formats.<\\/li>\\n<li>Fix: Blocked dates were not getting blocked if the blocked dates were the only custom setting.<\\/li>\\n<li>Fix: Inline date pickers were not automatically updating calculations when the date was changed.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-dates\\/formidable-dates.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"datepicker\"},\"26596685\":{\"title\":\"Directory\",\"name\":\"Directory\",\"display_name\":\"Directory\",\"slug\":\"directory\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/directory\\/formidable-directory-1.0.01.zip\"],\"excerpt\":\"\",\"id\":26596685,\"released\":\"2020-06-29 00:00:00\",\"categories\":[\"Business+Views\",\"Solution\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/formidable-directory\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/wordpress-directory-plugin\\/\",\"changelog\":\"<h4>v1.0.01 - October 4, 2021<\\/h4>\\n<ul>\\n<li>Fix: The frm-letter-filter shortcode would always filter by lname instead of using the custom param option.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-directory\\/formidable-directory.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"beta\":{\"version\":\"100\",\"location\":[\"fp.strategy11.com\\/form-templates\\/business-directory.xml\"]}},\"20897348\":{\"title\":\"Export View to CSV\",\"name\":\"Export View to CSV\",\"display_name\":\"Export View to CSV\",\"slug\":\"export-view\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/export-view\\/formidable-export-view-1.06.zip\"],\"excerpt\":\"Easily create custom CSV files and allow users to export their data from the front-end of your site.\",\"id\":20897348,\"released\":\"2019-08-01 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/table-view-to-csv\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/export-view\\/\",\"changelog\":\"<h4>v1.06 - June 13, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new frm_export_view_risky_characters filter that can be used to prevent an apostrophe from being prepended to cells starting with a +, = or @ character to prevent Spreadsheet applications from running formulas.<\\/li>\\n<li>Fix: The [entry_position] shortcode was resetting back to zero after every 30 rows when exporting as CSV.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - October 28, 2021<\\/h4>\\n<ul>\\n<li>Performance: Reduce the memory usage required to load global settings for sites with thousands of views.<\\/li>\\n<li>Fix: Prevent empty rows that were sometimes being included when exporting a visual table view.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - May 25, 2021<\\/h4>\\n<ul>\\n<li>Fix: Added a missing default parameter that was causing a deprecation message in PHP8.<\\/li>\\n<\\/ul>\\n<h4>v1.03 - November 2, 2020<\\/h4>\\n<ul>\\n<li>Change the date in the file name to something more readable<\\/li>\\n<li>Fix: Non-english characters were being converted to question marks<\\/li>\\n<\\/ul>\\n<h4>v1.02 - July 15, 2020<\\/h4>\\n<ul>\\n<li>New hooks: frm_export_view_link_expiration, frm_export_view_query_args, and frm_export_content<\\/li>\\n<li>Don\'t escape negative numbers in the export.<\\/li>\\n<li>Improve the exporting of special characters.<\\/li>\\n<li>Fix: Use the selected encoding for exports.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-export-view\\/formidable-export-view.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"export table\"},\"28123662\":{\"title\":\"FAQ\",\"name\":\"FAQ\",\"display_name\":\"FAQ\",\"slug\":\"faq\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28123662,\"released\":\"2022-05-02 13:25:45\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/faq\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"326042\":{\"title\":\"Form Action Automation\",\"name\":\"Form Action Automation\",\"display_name\":\"Form Action Automation\",\"slug\":\"autoresponder\",\"version\":\"2.05\",\"new_version\":\"2.05\",\"location\":[\"fp.strategy11.com\\/releases\\/autoresponder\\/formidable-autoresponder-2.05.zip\"],\"excerpt\":\"Schedule email notifications, SMS messages, and API actions.\",\"id\":326042,\"released\":\"2016-09-21 00:00:00\",\"categories\":[\"Elite\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/schedule-autoresponder\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/autoresponder\\/\",\"changelog\":\"<h4>v2.05 - June 13, 2022<\\/h4>\\n<ul>\\n<li>Fix: Automation events were not getting unscheduled when an action or automation setting was deleted.<\\/li>\\n<li>Fix: Changes to automation settings were not saving for disabled actions.<\\/li>\\n<li>Fix: Automated entry creation events were getting triggered when saving drafts.<\\/li>\\n<\\/ul>\\n<h4>v2.04 - January 13, 2021<\\/h4>\\n<ul>\\n<li>Improve the way entry limits are tracked, and only store them when the limit is set. This saves database space and improves efficiency.<\\/li>\\n<li>Use local times for all the time stamps to make the logging and scheduled list more clear.<\\/li>\\n<li>When a form is duplicated, update the automation settings to match up with the duplicated fields.<\\/li>\\n<li>Fix: Prevent Zapier from triggering twice<\\/li>\\n<\\/ul>\\n<h4>v2.03 - May 30, 2019<\\/h4>\\n<ul>\\n<li>Update the settings layout a bit for Formidable v4.0<\\/li>\\n<li>Code: Add automation for plugin releases<\\/li>\\n<li>Code: Update for better WordPress code styling<\\/li>\\n<\\/ul>\\n<h4>v2.02 - November 7, 2018<\\/h4>\\n<ul>\\n<li>New: Allow user registration to be scheduled with the automation settings<\\/li>\\n<li>Fix: When a form action is disabled, don\'t trigger it with the automation<\\/li>\\n<\\/ul>\\n<h4>v2.01 - August 1, 2018<\\/h4>\\n<ul>\\n<li>Fix: Replace __DIR__ for php 5.2 support<\\/li>\\n<li>Fix: Prevent php warning with empty dates<\\/li>\\n<li>Fix: Switch to non-deprecated save_settings function<\\/li>\\n<li>A bunch of codestyling changes, messages for translators, and escape translated strings<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-autoresponder\\/formidable-autoresponder.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"automate, automation\"},\"168072\":{\"title\":\"Formidable API\",\"name\":\"Formidable API\",\"display_name\":\"Formidable API\",\"slug\":\"formidable-api\",\"version\":\"1.13\",\"new_version\":\"1.13\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-api\\/formidable-api-1.13.zip\"],\"excerpt\":\"Add a full forms API for forms, form fields, views, and entries. Then send submissions to other sites with REST APIs.\",\"id\":168072,\"released\":\"2016-06-08 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-api\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-api\\/\",\"changelog\":\"<h4>v1.13 - November 9, 2022<\\/h4>\\n<ul>\\n<li>Fix: API Actions were triggering a \\\"Call to a member function has_param\\\" fatal error with WordPress 6.1.<\\/li>\\n<li>Fix: Safari browsers were not loading a script in API script iframes as expected, resulting in small iframes without a proper height value set.<\\/li>\\n<\\/ul>\\n<h4>v1.12 - August 29, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new Character Set setting to API actions for setting the charset in the API request\'s Content-Type header.<\\/li>\\n<li>New: API format and character set are now passed when testing a connection to get more accurate test results.<\\/li>\\n<li>Fix: Error response from connection tests were missing a space.<\\/li>\\n<\\/ul>\\n<h4>v1.11 - March 16, 2022<\\/h4>\\n<ul>\\n<li>Fix: Fixed \\\"frm_js is not defined\\\" console error that was breaking some API short codes. Added safer checks when loading API short codes and removed jQuery dependency from API request.<\\/li>\\n<\\/ul>\\n<h4>v1.10 - February 23, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new form embed script available in the Embed Form modal. This script can be embedded on another site, including non-WordPress sites.<\\/li>\\n<li>New: [frm-api] shortcodes can now be easily copied from the Embed Form modal.<\\/li>\\n<li>New: Forms loaded from an API endpoint will now always submit with AJAX even if the setting is not turned on to prevent embedded forms from redirecting to the source site on submission.<\\/li>\\n<li>Fix: Creating and updating entries with the REST API was failing validation if the \\\"Check entries for spam using JavaScript\\\" option was turned on.<\\/li>\\n<li>Fix: Trying to load a form that does not exist with the REST API was not properly displaying a 404 error.<\\/li>\\n<li>Fix: Signature fields were not initializing in forms loaded from an API endpoint.<\\/li>\\n<li>Fix: Dropzone uploads were getting blocked with 403 errors in forms loaded from an API endpoint.<\\/li>\\n<li>Fix: Localized date pickers were not translating in forms loaded from an API endpoint.<\\/li>\\n<\\/ul>\\n<h4>v1.09 - June 21, 2021<\\/h4>\\n<ul>\\n<li>Fix: There was an error when setting the limit to 1 when calling the \\/wp-json\\/frm\\/v2\\/forms endpoint to get a single form.<\\/li>\\n<li>Fix: Updating an entry via API with a reCAPTCHA field would return a 409 error.<\\/li>\\n<li>Fix: Calculations in repeaters were not counting the first row when using the [frm-api] shortcode.<\\/li>\\n<li>Fix: Loading a form with [frm-api] would occasionally cause other forms on the page to use the wrong urls.<\\/li>\\n<li>Fix: Checkbox fields could not get updated via the API if options were using separate values.<\\/li>\\n<li>Fix: Conditional logic was not triggering on load for forms loaded with the [frm-api] shortcode.<\\/li>\\n<li>Fix: The page parameter was not working calling the \\/wp-json\\/frm\\/v2\\/forms endpoint.<\\/li>\\n<li>Fix: Prevent an error that happens on requests when the lite Formidable plugin is disabled.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-api\\/formidable-api.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28058862\":{\"title\":\"Formidable Apps + Forms Business\",\"name\":\"Formidable Apps + Forms Business\",\"display_name\":\"Formidable Apps + Forms Business\",\"slug\":\"formidable-views-business\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28058862,\"released\":\"2021-05-12 12:27:07\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-views-business\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28058860\":{\"title\":\"Formidable Apps + Forms Elite\",\"name\":\"Formidable Apps + Forms Elite\",\"display_name\":\"Formidable Apps + Forms Elite\",\"slug\":\"formidable-views-elite\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28058860,\"released\":\"2021-05-12 12:22:02\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-views-elite\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"20834175\":{\"title\":\"Formidable Payments\",\"name\":\"Formidable Payments\",\"display_name\":\"Formidable Payments\",\"slug\":\"formidable-payments\",\"version\":\"1.14\",\"new_version\":\"1.14\",\"location\":[\"fp.strategy11.com\\/releases\\/payments\\/formidable-payments-1.14.zip\"],\"excerpt\":\"\",\"id\":20834175,\"released\":\"2018-11-06 12:08:25\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-payments\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"93790\":{\"title\":\"Formidable Pro\",\"name\":\"Formidable Pro\",\"display_name\":\"Formidable Pro\",\"slug\":\"formidable-pro\",\"version\":\"5.5.5\",\"new_version\":\"5.5.5\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-pro-5.5.5.zip\"],\"excerpt\":\"\",\"id\":93790,\"released\":\"2010-02-01 16:27:26\",\"categories\":[\"Basic\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-pro\\/\",\"changelog\":\"<h4>v5.5.5 - December 15, 2022<\\/h4>\\n<ul>\\n<li>Security: Additional validation has been added when viewing an Application template to make sure that the endpoint cannot be manipulated and used for unsafe requests.<\\/li>\\n<li>Fix: Updated a misspelled \\\"horizonally\\\" option.<\\/li>\\n<li>Fix: An application would not render its items in the table when one of the items included a form shortcode targeting a form that does not exist.<\\/li>\\n<li>The start over button longer is no longer on by default for new forms.<\\/li>\\n<\\/ul>\\n<h4>v5.5.4.1 - December 2, 2022<\\/h4>\\n<ul>\\n<li>Fix: Prevent a JavaScript error that triggers after adding a new repeater row when the repeater form does not include a slider field.<\\/li>\\n<li>Fix: Prevent a JavaScript error when clicking on SVG elements.<\\/li>\\n<li>Fix: Only the first slider field in a repeater row would format as currency on load.<\\/li>\\n<li>Fix: The rootline dropdown would always appear for styles that have the \\\"Override theme styling\\\" setting enabled.<\\/li>\\n<\\/ul>\\n<h4>v5.5.4 - December 1, 2022<\\/h4>\\n<ul>\\n<li>New: Rich text fields can now be set to read only.<\\/li>\\n<li>New: Rootline pagination will now be kept to a single row. Mobile widths without enough space to fit every page will hide extra page numbers in a dropdown toggled by a new rootline item with an ellipsis.<\\/li>\\n<li>New: Currency format settings for Slider fields will now also be applied to the min\\/max labels that get appended when a Before\\/After Input option is set.<\\/li>\\n<li>Fix: HTML in options for radio buttons and checkboxes using the Images display format was being escaped in summary fields and when viewing entries. It is now filtered instead to support some HTML elements.<\\/li>\\n<li>Fix: Character limit validation wasn\'t accurate for UTF-8 strings that include characters such as \\u00c6, \\u00d8 and \\u00c5.<\\/li>\\n<li>Fix: Integer shortcodes will no longer match for a form for field IDs that don\'t exist. This was causing issues with the sanitize_url=1 option getting added to success URLs for shortcodes like [0] that should be left alone.<\\/li>\\n<li>Fix: Progress bars were not appearing on the \\\"Edit Entry\\\" and \\\"View Entry\\\" admin pages since the v5.5.1 update that added pagination position options.<\\/li>\\n<li>Fix: Avoid a PHP8 deprecation message passing a null value when calling kses while displaying an entry value shortcode that does not exist.<\\/li>\\n<li>Fix: Repeater form field transients will now be deleted when a field is moved from the repeater to somewhere else in the form. Old transient data not being updated would result in cases where a field may appear twice, both inside and outside of the repeater.<\\/li>\\n<li>Fix: The option to format a number as currency was not working for repeated and embedded slider fields if no fields in the parent form had a currency defined.<\\/li>\\n<\\/ul>\\n<h4>v5.5.3 - November 3, 2022<\\/h4>\\n<ul>\\n<li>New: Formidable-styled submit buttons will now appear at half opacity with a disallowed cursor pointer when disabled.<\\/li>\\n<li>New: Draft pages can now be selected when adding existing items to an application.<\\/li>\\n<li>New: Password field strength will now validate in JavaScript when the setting is enabled.<\\/li>\\n<li>New: Added a new \\\"page\\\" option to form shortcodes. For example, [formidable id=454 page=2] will begin on the 2nd page of a form, and [formidable id=pages page=start-page] will begin based on the value of a start-page get param.<\\/li>\\n<li>Fix: Some application templates would fail to import because of an unexpected conflicting attribute in newer XML exports.<\\/li>\\n<li>Fix: Fields inside of a duplicated section were not properly wrapped in a field group in the form builder until after refreshing the page.<\\/li>\\n<li>Fix: Views wouldn\'t appear in Applications when Polylang was active because of a filtering conflict.<\\/li>\\n<li>Fix: Calculations weren\'t triggering on page load after hitting the back button on Chrome and Edge.<\\/li>\\n<li>Fix: A regex pattern was growing too large when importing an XML file with thousands of fields resulting in a \\\"Compilation failed: regular expression is too large at offset\\\" warning.<\\/li>\\n<li>Fix: Additional checks were added to import to prevent warnings when tracking child entries and when importing an unexpected date value.<\\/li>\\n<li>Fix: Cascading look up field options were not appearing (this was already patched in some versions of the previous release).<\\/li>\\n<li>Fix: Taxonomy rows in post actions would disappear from post actions after changing taxonomy type.<\\/li>\\n<li>Fix: The \\\"Exclude options\\\" checkbox for taxonomy rows in post actions would remain checked after saving unless all options were also unchecked.<\\/li>\\n<li>Fix: All fields will be hidden again when using a form shortcode with the fields=\\\"\\\" option like in previous 5.0.x versions of Pro.<\\/li>\\n<\\/ul>\\n<h4>v5.5.2 - October 13, 2022<\\/h4>\\n<ul>\\n<li>New: Scale fields now use open fields for defining a min and max range value, and include a new step option.<\\/li>\\n<li>New: Page break fields can now be filtered using the frm_display_break_value_custom filter. See https:\\/\\/formidableforms.com\\/knowledgebase\\/frm_display_field-type_value_custom\\/ for examples.<\\/li>\\n<li>New: Dynamic fields now have a option order setting similar to Look ups.<\\/li>\\n<li>Fix: Forms made with Gutenberg blocks were not working with [frm-set-get] shortcodes.<\\/li>\\n<li>Fix: Prevent a warning when duplicating fields with array data, like check boxes.<\\/li>\\n<li>Fix: Batched requests for dynamic field data were processing too frequently in some cases.<\\/li>\\n<li>Fix: Updated scale field styling on the Edit Entry page to fix visual issues at mobile screen sizes.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-pro\\/formidable-pro.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-772x250.png\"},\"search_terms\":\"\"},\"28029934\":{\"title\":\"Formidable Pro Basic\",\"name\":\"Formidable Pro Basic\",\"display_name\":\"Formidable Pro Basic\",\"slug\":\"formidable-basic2\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28029934,\"released\":\"2020-11-13 12:10:10\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-basic2\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"19366995\":{\"title\":\"Formidable Pro Business Package\",\"name\":\"Formidable Pro Business Pac