ary 9, 2016<\\/h4>\\n<ul>\\n<li>Added options to separate out address fields. City, State, Zip, and Country can now be mapped separately.<\\/li>\\n<li>Fixed PHP7 warnings<\\/li>\\n<\\/ul>\\n<h4>v1.03 - December 10, 2015<\\/h4>\\n<ul>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.02 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent error when Formidable is disabled<\\/li>\\n<li>Reduce duplication with initializing the api<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-highrise\\/formidable-highrise.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2012\\/01\\/highrise.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"20811871\":{\"title\":\"HubSpot\",\"name\":\"HubSpot\",\"display_name\":\"HubSpot\",\"slug\":\"hubspot-wordpress\",\"version\":\"1.10\",\"new_version\":\"1.10\",\"location\":[\"fp.strategy11.com\\/releases\\/hubspot\\/formidable-hubspot-1.10.zip\"],\"excerpt\":\"HubSpot is a complete CRM platform with tools for increased leads, accelerated sales, or streamlined customer service.\",\"id\":20811871,\"released\":\"2018-09-04 00:00:00\",\"categories\":[\"CRM\",\"Elite\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/hubspot-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/hubspot-wordpress\\/\",\"changelog\":\"<h4>v1.10 - January 27, 2022<\\/h4>\\n<ul>\\n<li>New: Added support for Private Apps. You can integrate with HubSpot using a Private App Access Token instead of your Public App API key.<\\/li>\\n<li>New: Added additional instructions for getting started with HubSpot.<\\/li>\\n<\\/ul>\\n<h4>v1.09 - June 21, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to HubSpot.<\\/li>\\n<li>Fix: Nothing would get sent when a user id field was 