ttps:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"170655\":{\"title\":\"Mailchimp\",\"name\":\"Mailchimp\",\"display_name\":\"Mailchimp\",\"slug\":\"mailchimp\",\"version\":\"2.06\",\"new_version\":\"2.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-mailchimp\\/formidable-mailchimp-2.06.zip\"],\"excerpt\":\"Get on the path to more leads in minutes. Add and update leads in a Mailchimp mailing list when a form is submitted.\",\"id\":170655,\"released\":\"2013-10-17 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-mailchimp\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailchimp\\/\",\"changelog\":\"<h4>v2.06 - June 23, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to MailChimp.<\\/li>\\n<li>Fix: Prevent a warning when loading MailChimp action settings.<\\/li>\\n<\\/ul>\\n<h4>v2.05 - July 24, 2020<\\/h4>\\n<ul>\\n<li>New: Add support for MailChimp GDPR marketing settings. There must be a contact in the selected list before the settings will show in the form action.<\\/li>\\n<li>New: Add frm_mlcmp_tags hook for adding or removing tags.<\\/li>\\n<li>Fix: The email field wasn\'t showing in the unsubscribe settings<\\/li>\\n<\\/ul>\\n<h4>v2.04 - July 12, 2019<\\/h4>\\n<ul>\\n<li>Add support for MailChimp tags<\\/li>\\n<li>Add double opt-in for unsubscribed users that are resubscribing<\\/li>\\n<li>Add German translation<\\/li>\\n<li>Log API requests in the Formidable Logs<\\/li>\\n<li>Update the styling for the MailChimp icon in the form actions to better match 4.0<\\/li>\\n<li>Clean up the MailChimp form action settings<\\/li>\\n<li>Clarify the groups settings to make them a bit more intuitive<\\/li>\\n<li>Allow text fields to be selected for groups<\\/li>\\n<li>Show error messages along with the \'no mailing lists found\' message for easier debugging<\\/li>\\n<\\/ul>\\n<h4>v2.03 - October 26, 2017<\\/h4>\\n<ul>\\n<li>New: Add option to unsubscribe users.<\\/li>\\n<li>Enhancement: Automatically update subscriber if their email exists in the selected MailChimp list.<\\/li>\\n<li>Enhancement: Remove files and functions deprecated since version 2.0.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 12, 2017<\\/h4>\\n<ul>\\n<li>New: Allow Formidable Address fields to be mapped to MailChimp Address fields.<\\/li>\\n<li>Enhancement: Increase limit to 50 for group options retrieved.<\\/li>\\n<li>Enhancement: Initialize database on initial install.<\\/li>\\n<li>Enhancement: Add basic PHP error log messages for failed subscription.<\\/li>\\n<li>Fix: Don\'t generate PHP error if a timeout occurs when fetching group options.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-mailchimp\\/formidable-mailchimp.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/mailchimp.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"20781560\":{\"title\":\"MailPoet Newsletters\",\"name\":\"MailPoet Newsletters\",\"display_name\":\"MailPoet Newsletters\",\"slug\":\"mailpoet-newsletters\",\"version\":\"1.02\",\"new_version\":\"1.02\",\"location\":[\"fp.strategy11.com\\/releases\\/mailpoet\\/formidable-mailpoet-1.02.zip\"],\"excerpt\":\"Send WordPress newsletters from your own site with MailPoet. And use Formidable to for your newsletter signup forms.\",\"id\":20781560,\"released\":\"2018-06-05 00:00:00\",\"categories\":[\"Creator\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/mailpoet-newsletter-signup-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailpoet-newsletters\\/\",\"changelog\":\"<h4>v1.02 - July 12, 2022<\\/h4>\\n<ul>\\n<li>New: Added support for logging MailPoet subscriptions when the Logs add on is active.<\\/li>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to MailPoet.<\\/li>\\n<li>Fix: Users could not subscribe to multiple lists when the active language was not in English because the error check was specific to language.<\\/li>\\n<li>Fix: Prevent a warning when sending data with MailPoet action.<\\/li>\\n<li>Fix: Nothing would get sent when a user id field was set to something other than a name or email option.<\\/li>\\n<\\/ul>\\n<h4>v1.01 - September 14, 2018<\\/h4>\\n<ul>\\n<li>Fix error after form submit on some sites<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-mailpoet\\/formidable-mailpoet.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"163255\":{\"title\":\"Math Captcha\",\"name\":\"Math Captcha\",\"display_name\":\"Math Captcha\",\"slug\":\"math-captcha\",\"version\":\"1.15\",\"new_version\":\"1.15\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-math-captcha\\/formidable-math-captcha-1.15.zip\"],\"excerpt\":\"\",\"id\":163255,\"released\":\"2015-10-12 14:00:35\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/math-captcha\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28144027\":{\"title\":\"Member Directory\",\"name\":\"Member Directory\",\"display_name\":\"Member Directory\",\"slug\":\"member-directory\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28144027,\"released\":\"2022-08-24 15:18:56\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/member-directory\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"172715\":{\"title\":\"PayPal Basic\",\"name\":\"PayPal Basic\",\"display_name\":\"PayPal Basic\",\"slug\":\"paypal-standard-single-payments\",\"version\":\"3.08\",\"new_version\":\"3.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.08.zip\"],\"excerpt\":\"\",\"id\":172715,\"released\":\"2015-10-21 12:20:35\",\"categories\":[\"Ecommerce\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard-single-payments\\/\",\"changelog\":\"<h4>v3.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>Merge the older grandfathered PayPal addon with the updated version.<\\/li>\\n<\\/ul>\\n<h4>v2.04.07 - January 25, 2015<\\/h4>\\n<ul>\\n<li>Allow amounts with . for thousands and , for decimal. If a . is used in the decimal place for the amount when the currency uses a , make it work anyway<\\/li>\\n<li>Redirect to PayPal correctly without Pro<\\/li>\\n<li>Make sure email setting is trimmed before comparing<\\/li>\\n<li>Add download ID to make sure correct license is used<\\/li>\\n<\\/ul>\\n<h4>v2.04.06 - November 17, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when updating Formidable<\\/li>\\n<\\/ul>\\n<h4>v2.04.05<\\/h4>\\n<ul>\\n<li>Format decimals with . to allow float to work correctly<\\/li>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v2.04.04<\\/h4>\\n<ul>\\n<li>Allow the amount to be included in the \\\"other\\\" option<\\/li>\\n<li>Modify the user-agent in the IPN verification to prevent errors from PayPal<\\/li>\\n<\\/ul>\\n<h4>v2.04.03<\\/h4>\\n<ul>\\n<li>Save the IPN parameters with the payment in the format that allows for multiple IPN notifications<\\/li>\\n<li>Fix sending users to Paypal when 2.x is installed, but the old settings haven\'t been moved to a form action<\\/li>\\n<li>Increased security related to XSS add_query_arg vulnerability<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"163257\":{\"title\":\"PayPal Standard\",\"name\":\"PayPal Standard\",\"display_name\":\"PayPal Standard\",\"slug\":\"paypal-standard\",\"version\":\"3.09\",\"new_version\":\"3.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.09.zip\"],\"excerpt\":\"Collect instant payments and recurring payments to automate your online business. Calculate a total and send customers on to PayPal.\",\"id\":163257,\"released\":\"2012-09-04 00:00:00\",\"categories\":[\"Business\",\"Ecommerce\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-paypal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard\\/\",\"changelog\":\"<h4>v3.09 - July 30, 2019<\\/h4>\\n<ul>\\n<li>New: Account for tax when comparing amounts with the IPN<\\/li>\\n<li>Update form action icon and color<\\/li>\\n<li>Replace call to deprecated function with FrmFieldsHelper::get_user_display_name<\\/li>\\n<li>Requires Formidable v3.0+<\\/li>\\n<\\/ul>\\n<h4>v3.08 - November 18, 2017<\\/h4>\\n<ul>\\n<li>Allow field shortcodes in more payments settings so values can be set from the form: PayPal email, trial amount, repeat period, trial length. This also allows payments to go to other members on your site.<\\/li>\\n<li>Allow regular WordPress shortcodes and Formidable dynamic values (ie [email]) in addition to basic field shortcodes<\\/li>\\n<\\/ul>\\n<h4>v3.07 - November 10, 2017<\\/h4>\\n<ul>\\n<li>Process shortcodes in after payment settings. Allow entry values, default values, and other shortcodes.<\\/li>\\n<li>Clarify the payment trigger options with \\\"Successful PayPal payment\\\"<\\/li>\\n<\\/ul>\\n<h4>v3.06.01 - October 12, 2017<\\/h4>\\n<ul>\\n<li>New: Add Paypal triggers to API action.<\\/li>\\n<li>Fix: Show update notice for administrators only.<\\/li>\\n<li>Fix: Add missing close select tag in global settings.<\\/li>\\n<\\/ul>\\n<h4>v3.06 - December 9, 2016<\\/h4>\\n<ul>\\n<li>New: Add Paypal trigger to registration action for the registration 2.0 release<\\/li>\\n<li>Tweak: Don\'t add columns to entries when there is no form. This is in preparation for Formidable v2.03<\\/li>\\n<li>Tweak: If the log file setting is empty, fill it with the default setting<\\/li>\\n<li>Fix: Show correct values in the \\\"paid\\\" column on the Entries listing page if no payments have been made<\\/li>\\n<li>Fix: Add a fallback if invoice is missing from the IPN. This will help payments get matched up if the id of the payment doesn\'t get sent back to your site.<\\/li>\\n<li>Fix: Payment expiration dates are showing in 1970<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-paypal\\/formidable-paypal.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"paypal\"},\"28136428\":{\"title\":\"PDFs\",\"name\":\"PDFs\",\"display_name\":\"PDFs\",\"slug\":\"pdfs\",\"version\":\"1.0.3\",\"new_version\":\"1.0.3\",\"location\":[\"fp.strategy11.com\\/releases\\/pdfs\\/formidable-pdfs-1.0.3.zip\"],\"excerpt\":\"Create PDFs from form entries automatically. Email them or let visitors download PDFs from your site.\",\"id\":28136428,\"released\":\"2022-08-09 00:00:00\",\"