May 5, 2021<\\/h4>\\n<ul>\\n<li>New: Placeholders can now be translated for all field types.<\\/li>\\n<li>New: Descriptions can now be translated for Address and Credit Card fields.<\\/li>\\n<li>Fix: Translated default values were saving the translated value for radio buttons, check boxes, and dropdowns in some forms with multiple pages.<\\/li>\\n<li>Fix: Default values were not selected for radio buttons and check boxes in translated languages in some forms with multiple pages.<\\/li>\\n<\\/ul>\\n<h4>v1.08 - September 30, 2020<\\/h4>\\n<ul>\\n<li>Translated more values (summary page, placeholders, validation messages with ajax turned on).<\\/li>\\n<li>Get available strings to translate from core Formidable so new settings will be immediately available for translation<\\/li>\\n<li>Adjust layout to match Formidable 4.x+<\\/li>\\n<li>Fix: Update Formidable translation page to work with current Polylang versions<\\/li>\\n<li>Fix: Formidable strings weren\'t showing on the Polylang strings page<\\/li>\\n<li>Fix: Slashes were showing in some strings related to a Polylang update<\\/li>\\n<li>Update codestyling to meet WP standards<\\/li>\\n<\\/ul>\\n<h4>v1.07 - February 8, 2018<\\/h4>\\n<ul>\\n<li>Add rootline titles to translation settings<\\/li>\\n<li>Make repeating fields translatable<\\/li>\\n<li>Fix error message when no languages have been added in Polylang<\\/li>\\n<\\/ul>\\n<h4>v1.06 - December 8, 2016<\\/h4>\\n<ul>\\n<li>Fix: Adjusted the way form strings are saved in wp_options table to resolve packet size error.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-polylang\\/frm-poly.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28124372\":{\"title\":\"Product Reviews\",\"name\":\"Product Reviews\",\"display_name\":\"Product Reviews\