 disabled<\\/li>\\n<\\/ul>\\n<h4>v2.03 - October 11, 2018<\\/h4>\\n<ul>\\n<li>New: Add option to update Salesforce records<\\/li>\\n<li>New: Add support for Salesforce Boolean fields<\\/li>\\n<li>Fix: Multiselect picklist fields weren\'t getting correct values from a checkbox<\\/li>\\n<li>Fix: Date fields set as a post field were sending the wrong date format<\\/li>\\n<li>Fix: Fatal error caused by date fields in certain formats<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 14, 2018<\\/h4>\\n<ul>\\n<li>Add API calls to <a href=\\\"https:\\/\\/formidableforms.com\\/features\\/api-logs\\/\\\">Logs plugin<\\/a><\\/li>\\n<li>Add more messages for debugging<\\/li>\\n<li>Fix issue with authenticating on an SSL site<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-salesforce\\/formidable-salesforce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"163248\":{\"title\":\"Signature\",\"name\":\"Signature\",\"display_name\":\"Digital Signatures\",\"slug\":\"signature\",\"version\":\"3.0.1\",\"new_version\":\"3.0.1\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-signature\\/formidable-signature-3.0.1.zip\"],\"excerpt\":\"Add an electronic signature to your WordPress form. The visitor may write their signature with a trackpad\\/mouse or type it.\",\"id\":163248,\"released\":\"2013-03-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-signature\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/signature\\/\",\"changelog\":\"<h4>v3.0.1 - December 7, 2022<\\/h4>\\n<ul>\\n<li>Fix: Styling a signature field was inconsistent based on the type of color value set.<\\/li>\\n<li>Fix: Signature fields would break in some cases where the scripts have been merged and modified, resulting in a \\\"Uncaught TypeError: b is not a function\\\" message.<\\/li>\\n<li>Fix: Signature toggle buttons would disappear on focus when using the Twenty Twenty One theme.<\\/li>\\n<li>Fix: Empty signature field values were not saving as expected so filtering for entries without a signature wouldn\'t return the expected results.<\\/li>\\n<li>Fix: In some cases signature files were unable to get saved because the WordPress file system being used by default would require additional credentials to work.<\\/li>\\n<\\/ul>\\n<h4>v3.0 - August 1, 2022<\\/h4>\\n<ul>\\n<li>New: Updated signature scripts to use a newer, better supported signature library.<\\/li>\\n<li>New: The start over button will now reset signatures when clicked.<\\/li>\\n<li>Fix: Prevent a PHP 8.1 deprecated message that gets triggered when converting signatures to images.<\\/li>\\n<\\/ul>\\n<h4>v2.07 - May 2, 2022<\\/h4>\\n<ul>\\n<li>New: A new \\\"Allow editing\\\" checkbox setting has been added to signature fields. When toggled signatures can be cleared and updated when editing in place and when editing draft entries.<\\/li>\\n<li>Fix: Typed signature text was getting cut off when the default form style was set to override theme styling.<\\/li>\\n<\\/ul>\\n<h4>v2.06 - February 22, 2022<\\/h4>\\n<ul>\\n<li>New: Signature styles are now included in shared Formidable CSS instead of being loaded as a separate file.<\\/li>\\n<li>Fix: Draw events were triggering non-breaking JavaScript errors.<\\/li>\\n<\\/ul>\\n<h4>v2.05 - October 28, 2021<\\/h4>\\n<ul>\\n<li>Fix: Typed signatures were appearing blank in CSV exports.<\\/li>\\n<li>Fix: JavaScript validation will now display an error message for a required empty signature.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-signature\\/signature.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"310430\":{\"title\":\"Stripe\",\"name\":\"Stripe\",\"display_name\":\"Stripe\",\"slug\":\"stripe\",\"version\":\"3.0\",\"new_version\":\"3.0\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-stripe\\/formidable-stripe-3.0.zip\"],\"excerpt\":\"Any Formidable forms on your site can accept credit card payments without users ever leaving your site.\",\"id\":310430,\"released\":\"2016-04-26 00:00:00\",\"categories\":[\"Business\",\"Ecommerce\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/stripe\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/stripe\\/\",\"changelog\":\"<h4>v3.0 - December 6, 2022<\\/h4>\\n<ul>\\n<li>New: A new \\\"Use previously saved card with Stripe link.\\\" toggle has been added to Stripe actions. Now customers can save their credit card with Stripe and use it again later using a 6 digit verification code sent to their phone.<\\/li>\\n<\\/ul>\\n<h4>v2.07 - October 4, 2022<\\/h4>\\n<ul>\\n<li>New: Added more caching and error handling for Stripe events to help improve performance.<\\/li>\\n<li>Fix: Actions that trigger on failed payments would also trigger for a pending 3D secure payment.<\\/li>\\n<li>Fix: Stripe forms were not properly submitting when on a translated WPML page when using the different languages in directories setting.<\\/li>\\n<li>Fix: Forms were not always properly restarting after a failed payment.<\\/li>\\n<li>Fix: A one time 3D secure payment would stay as pending and never update to complete or failed when processing the payment after creating the entry.<\\/li>\\n<li>Fix: A recurring 3D secure payment would get set to failed before finishing 3D secure verification, triggering actions immediately that happen on failed payment.<\\/li>\\n<\\/ul>\\n<h4>v2.06 - May 11, 2022<\\/h4>\\n<ul>\\n<li>New: When a credit card fails on a form with multiple pages, the form will restart on the page with the credit card field present.<\\/li>\\n<li>New: Added additional currencies from Pro.<\\/li>\\n<li>Fix: Invisible reCAPTCHA fields were causing forms with Stripe payments to fail validation.<\\/li>\\n<li>Fix: Updated incorrect text domains.<\\/li>\\n<\\/ul>\\n<h4>v2.05 - August 2, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now properly map to the first and last name options when using Stripe actions.<\\/li>\\n<li>Fix: Pages translated with WPML were not able to properly validate a connected stripe payment.<\\/li>\\n<\\/ul>\\n<h4>v2.04 - February 8, 2021<\\/h4>\\n<p>New: Added better security with Stripe Connect. Now you can connect to Stripe with a click of a button and never have to copy and paste any API keys for Stripe again. <strong>It is recommended that you go to Stripe Settings and switch to the new integration as soon as possible.<\\/strong><\\/p>\\n\",\"plugin\":\"formidable-stripe\\/formidable-stripe.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28067256\":{\"title\":\"Surveys and Polls\",\"name\":\"Surveys and Polls\",\"display_name\":\"Surveys and Polls\",\"slug\":\"surveys\",\"version\":\"1.0.06\",\"new_version\":\"1.0.06\",\"location\":[\"fp.strategy11.com\\/releases\\/surveys\\/formidable-surveys-1.0.06.zip\"],\"excerpt\":\"Transform your WordPress site into a data collection machine with our user-friendly survey form builder.\",\"id\":28067256,\"released\":\"2021-09-16 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/surveys-and-polls-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/surveys\\/\",\"changelog\":\"<h4>v1.0.06 - July 5, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new frm_surveys_likert_responsive_breakpoint filter for customizing the responsiveness point for Likert fields.<\\/li>\\n<li>Fix: Improved how Likert fields are exported and imported as CSV. A column will no longer be exported for the Likert field parent, and the name of the Likert field will be prepended in the headers of the child question fields.<\\/li>\\n<li>Fix: Likert field values in repeaters were not properly getting set when importing data with a CSV file.<\\/li>\\n<li>Fix: Likert row and column options were not draggable when loaded via AJAX in a long form.<\\/li>\\n<li>Fix: Deleting every column in a Likert would cause the field to break and warnings to get triggered on preview.<\\/li>\\n<li>Fix: Likert styling was not working properly when the Likert was conditionally hidden.<\\/li>\\n<li>Fix: NPS fields from previous pages were not working in calculations in multiple page forms.<\\/li>\\n<\\/ul>\\n<h4>v1.0.05 - March 4, 2022<\\/h4>\\n<ul>\\n<li>Fix: Custom validation messages were not being used for required Likert fields.<\\/li>\\n<li>Fix: Error messages were not appearing properly for required Likert fields inside of repeaters.<\\/li>\\n<li>Fix: JavaScript validation was not working for required Likert fields inside of repeaters.<\\/li>\\n<\\/ul>\\n<h4>v1.0.04 - January 12, 2022<\\/h4>\\n<ul>\\n<li>Fix: Error messages were appearing inline with Likert options when a required Likert field was validated with JavaScript.<\\/li>\\n<li>Fix: Bulk edit was broken for Likert fields.<\\/li>\\n<li>Fix: Likert fields were not loading properly in the form builder when retrieved with an AJAX request.<\\/li>\\n<\\/ul>\\n<h4>v1.0.03 - November 8, 2021<\\/h4>\\n<ul>\\n<li>New: Added a new \\\"Separate column values\\\" setting to Likert Scale fields so labels can be used with score values, making it easier to calculate stats from Likert Scale results.<\\/li>\\n<li>Fix: Prevent a fatal error that happens when viewing a form when label width styles are not measured in pixels.<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - September 28, 2021<\\/h4>\\n<ul>\\n<li>Fix: Required likert fields were causing validation to fail on forms with multiple pages.<\\/li>\\n<li>Fix: Required NPS fields are now more accessible with screen readers.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-surveys\\/formidable-surveys.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28123668\":{\"title\":\"Team Directory\",\"name\":\"Team Directory\",\"display_name\":\"Team Directory\",\"slug\":\"team-directory\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28123668,\"released\":\"2022-05-02 13:24:48\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/team-directory\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"168460\":{\"title\":\"Twilio\",\"name\":\"Twilio\",\"display_name\":\"Twilio WordPress SMS\",\"slug\":\"twilio\",\"version\":\"1.09\",\"new_version\":\"1.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-twilio\\/formidable-twilio-1.09.zip\"],\"excerpt\":\"Allow users to text their votes for polls created by Formidable Forms, or send SMS notifications when entries are submitted or updated.\",\"id\":168460,\"released\":\"2014-03-10 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/twilio-add-on\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/twilio\\/\",\"changelog\":\"<h4>v1.09 - November 2, 2020<\\/h4>\\n<ul>\\n<li>New: Include sending numbers from the linked Twilio account in a dropdown. This makes it much easier to send messages successfully.<\\/li>\\n<li>New: Process the [default-message] when sending in an SMS message.<\\/li>\\n<li>Add more guidance to connect to the Twilio API and show messages in the form action when connecting fails.<\\/li>\\n<li>Fix: Some responses were not getting saved correctly into radio and checkbox fields.<\\/li>\\n<li>Clean up and update the code including removing support for Formidable &lt;2.0.<\\/li>\\n<\\/ul>\\n<h4>v1.08 - January 16, 2017<\\/h4>\\n<ul>\\n<li>Improved: Removed deprecated instructions and screenshot.<\\/li>\\n<li>Improved: Removed deprecated valign attribute from table HTML.<\\/li>\\n<\\/ul>\\n<h4>v1.07 - November 1, 2016<\\/h4>\\n<ul>\\n<li>When an SMS message is received, run validation and respond with a text that includes any error messages<\\/li>\\n<li>When a text is received successfully, respond with the form success message, filtered list like a form does.<\\/li>\\n<li>Allow for the \\\"other\\\" fields to be filled from a text submission<\\/li>\\n<li>Check if license number is for correct plugin<\\/li>\\n<li>Don\'t try to send messages to a blank number<\\/li>\\n<\\/ul>\\n<h4>v1.06 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_format_number filter for formatting the phone number before it\'s sent to Twilio<\\/li>\\n<li>Fix license activation<\\/li>\\n<\\/ul>\\n<h4>v1.05 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_sms_response hook for changing the message in the text<\\/li>\\n<li>Allow for 8-digit numbers. +65 phone numbers were having trouble because we assumed they should be US numbers. Now if the number starts with a +, don\'t add the +1<\\/li>\\n<li>Get updates from FormidableForms.com<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-twilio\\/formidable-twilio.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"168456\":{\"title\":\"Upload Importer\",\"name\":\"Upload Importer\",\"display_name\":\"Upload Importer\",\"slug\":\"upload-importer\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-upload-importer\\/formidable-upload-importer-1.0.01.zip\"],\"excerpt\":\"\",\"id\":168456,\"released\":\"2015-10-16 17:05:47\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/upload-importer\\/\",\"changelog\":\"<h4>v1.0.01<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0<\\/h4>\\n<ul>\\n<li>Allow importing of multiple file uploads<\\/li>\\n<li>Replace deprecated mime_content_type with fileinfo<\\/li>\\n<li>Update auto-updating<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"173984\":{\"title\":\"User Registration\",\"name\":\"User Registration\",\"display_name\":\"User Registration\",\"slug\":\"user-registration\",\"version\":\"2.09\",\"new_version\":\"2.09\",\"location\":[\"s3.amazonaws.com\\/fp.strategy11.com\\/releases\\/formidable-registration\\/formidable-registration-2.09.zip\"],\"excerpt\":\"Give new users access to your site quickly and painlessly. Plus edit profiles and login from the front end.\",\"id\":173984,\"released\":\"2011-12-21 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/user-registration\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-registration\\/\",\"changelog\":\"<h4>v2.09 - October 4, 2022<\\/h4>\\n<ul>\\n<li>New: Page dropdowns for registration pages now use an autocomplete input for sites with more than 50 pages, reducing the amount of memory required for websites with many pages.<\\/li>\\n<li>Fix: Fix a conflict with the All in One WP Security plugin. Previously a Formidable login page would not properly load the reCAPTCHA scripts that are initialized by All in One WP Security.<\\/li>\\n<li>Fix: Login, registration, and password reset pages will now use the localized links set by Polylang based on the user\'s active language defined by Polylang.<\\/li>\\n<li>Fix: Users who can normally edit other user\'s entries were not able to update user meta values unless they also had permission to create users.<\\/li>\\n<\\/ul>\\n<h4>v2.08 - June 13, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new frmreg_show_meta_on_profile filter for toggling off the user meta that is displayed on user profiles.<\\/li>\\n<li>Fix: User meta was not appearing in user profiles in newer versions of WordPress.<\\/li>\\n<li>Fix: Links to resend emails were being stripped from HTML.<\\/li>\\n<li>Fix: The class_reminder [frm-login] shortcode option was not being applied unless show_lost_password was set.<\\/li>\\n<li>Fix: When a user was activated, the new role was overwriting any other roles that were applied to the user that were added before activation.<\\/li>\\n<li>Fix: Some users registered on update with a chosen password were having problems logging in because of a role issue.<\\/li>\\n<\\/ul>\\n<h4>v2.07 - May 10, 2022<\\/h4>\\n<ul>\\n<li>Fix: A conflict with Limited Login Attempts Reloaded was causing performance issues in some cases resulting in high CPU usage.<\\/li>\\n<\\/ul>\\n<h4>v2.06 - May 4, 2022<\\/h4>\\n<ul>\\n<li>Fix: Resolved a conflict with Woocommerce that was causing a fatal error on automatic login with last release when Woocoomerce tracking was enabled.<\\/li>\\n<\\/ul>\\n<h4>v2.05 - April 28, 2022<\\/h4>\\n<ul>\\n<li>Security: Added more validation, sanitizing, filtering, and escaping.<\\/li>\\n<li>New: Errors will no longer be shown when trying to reset the password for an invalid username or email to help avoid user enumeration exploits.<\\/li>\\n<li>New: Strong passwords are now required when resetting passwords. This can be disabled by adding add_filter( \'frm_reg_password_strength_check\', \'__return_false\' ); as a code snippet.<\\/li>\\n<li>New: Added new frm_reg_login_limit_feature_activated and <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass \\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">frm_reg_login_limit_exceeded_error_message<\\/span><\\/span> filters for handling custom login limiting rules.<\\/li>\\n<li>Fix: Fixed conflicts with Loginizer and Limit Login Attempts Reloaded, where login attempts were not being limited with Formidable login forms.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-registration\\/formidable-registration.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"registration, user registration, register\"},\"170649\":{\"title\":\"User Tracking\",\"name\":\"User Tracking\",\"display_name\":\"User Flow\",\"slug\":\"user-tracking\",\"version\":\"2.0\",\"new_version\":\"2.0\",\"location\":[\"s3.amazonaws.com\\/fp.strategy11.com\\/releases\\/formidable-user-tracking\\/formidable-user-tracking-2.0.zip\"],\"excerpt\":\"Track the pages a user visits and the time spent on each page prior to submitting a form.\",\"id\":170649,\"released\":\"2015-10-19 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-user-tracking\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-tracking\\/\",\"changelog\":\"<h4>v2.0 - November 1, 2022<\\/h4>\\n<ul>\\n<li>Update the display of the user flow through the site for better readability and more actionable data.<\\/li>\\n<li>Include timestamps in the session tracking so we know how much time was spent on each page.<\\/li>\\n<li>Show the page name for better readability.<\\/li>\\n<li>Add form submissions into session tracking so we know what forms were submitted before this one.<\\/li>\\n<li>Show a summary of how much time between the first time we logged the user and when the form was submitted.<\\/li>\\n<li>Fix: Do not start session when running a Cron.<\\/li>\\n<\\/ul>\\n<h4>v1.0 - August 25, 2016<\\/h4>\\n<ul>\\n<li>Save the tracking info before the email is sent<\\/li>\\n<li>Make sure license key is correct before saving<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-user-tracking\\/formidable-user-tracking.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28027505\":{\"title\":\"Views\",\"name\":\"Views\",\"display_name\":\"Legacy Views\",\"slug\":\"views\",\"version\":\"4.0.05\",\"new_version\":\"4.0.05\",\"location\":[\"fp.strategy11.com\\/releases\\/views\\/formidable-views-4.0.05.zip\"],\"excerpt\":\"Add the power of views to your Formidable Forms to display your form submissions in listings, tables, calendars, and more.\",\"id\":28027505,\"released\":\"2010-10-28 00:00:00\",\"categories\":[\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase-category\\/views\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/views\\/\",\"changelog\":\"<h4>v5.2.1 - June 2, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new Application column to the views list page.<\\/li>\\n<li>New: Improved support for the new Add\\/Edit Applications and Access Application Dashboard permission settings added in Pro.<\\/li>\\n<\\/ul>\\n<h4>v5.2 - May 24, 2022<\\/h4>\\n<ul>\\n<li>New: Added support for using views with Applications.<\\/li>\\n<li>Fix: Updated Elementor widget so it no longer uses the deprecated _register_controls method.<\\/li>\\n<li>Fix: Fixed issues with deprecated messages in PHP 8.1.<\\/li>\\n<\\/ul>\\n<h4>v4.0.05 - June 16, 2021<\\/h4>\\n<ul>\\n<li>New: Optimized how meta for views is retrieved to improve support for sites with thousands of views.<\\/li>\\n<li>Fix: Updated the view excerpt filter to prevent a conflict with some other third party plugins.<\\/li>\\n<\\/ul>\\n<h4>v4.0.04 - May 27, 2021<\\/h4>\\n<ul>\\n<li>New: Added backward compatibility for the new visual grid views (in beta).<\\/li>\\n<li>Fix: Entries created at the same time were appearing on multiple pages due to a sorting issue.<\\/li>\\n<li>Fix: The shortcode options popup for setting custom content in a post action would not close in Chrome.<\\/li>\\n<\\/ul>\\n<h4>v4.0.03 - December 7, 2020<\\/h4>\\n<ul>\\n<li>New: Allow multiple ids for the view shortcode in entry_id=\'25,26\'<\\/li>\\n<li>Fix: Views weren\'t searchable by id<\\/li>\\n<li>Move code from Formidable Pro to customize post content when creating posts<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-views\\/formidable-views.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"28058856\":{\"title\":\"Visual Views\",\"name\":\"Visual Views\",\"display_name\":\"Visual Views\",\"slug\":\"visual-views\",\"version\":\"5.3.3\",\"new_version\":\"5.3.3\",\"location\":[\"fp.strategy11.com\\/releases\\/views\\/formidable-views-5.3.3.zip\"],\"excerpt\":\"Create WordPress web apps to display your form submissions in grids, tables, calendars, and more.\",\"id\":28058856,\"released\":\"2021-05-31 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase-category\\/views\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/visual-views\\/\",\"changelog\":\"<h4>v5.3.3 - October 27, 2022<\\/h4>\\n<ul>\\n<li>New: The form title at the top of the view editor now shows the view title in a dropdown instead. This can be used to jump to other views more quickly without leaving the editor.<\\/li>\\n<li>New: Canonical URLs will now be filtered for views to make sharing easier for detail pages and pages with get param filters. Some sharing tools, including Facebook and the Safari share option on iOS, would always share the URL of the listing page instead without filters.<\\/li>\\n<li>New: Added a few default grid style rules as a fallback for cases where CSS variables are not supported.<\\/li>\\n<li>Fix: All entries would appear when filtering with a [get param] shortcode and using an \\\"OR\\\" when a get param was set but didn\'t match.<\\/li>\\n<li>Fix: Changed the check for the view editor for better compatibility. In some cases the class name was not getting added resulting in a few issues including a case where clicking a shortcode option wouldn\'t insert into the rich text editor when editing view content.<\\/li>\\n<li>Fix: Detail links would switch to using the view\'s URL instead of the URL of the page the view is nested in when AJAX pagination was on after changing the page for the first time.<\\/li>\\n<li>Fix: Added extra style rules for the view editor to avoid conflicting CSS causing the header to appear smaller than full width on the page.<\\/li>\\n<li>New views will no longer be named automatically when the form dropdown is shown to avoid names being replaced by a default when the form changes.<\\/li>\\n<li>The close button in the view editor will now link to the view list instead of the form list.<\\/li>\\n<\\/ul>\\n<h4>v5.3.2 - September 26, 2022<\\/h4>\\n<ul>\\n<li>New: [form_name] shortcodes now work in Views.<\\/li>\\n<li>Fix: All entries would appear when using \\\"OR\\\" filters when filtering by a [get] shortcode that does not exist.<\\/li>\\n<li>Fix: No entries would appear when using \\\"OR\\\" filter when filtering by current_user if the user was not logged in.<\\/li>\\n<li>Fix: Remove an extra unexpected border around Grid views that happened when a border thickness was set because of a conflict with WordPress.<\\/li>\\n<li>Fix: AJAX Pagination will now work if the view content is wrapped in a &lt;div&gt; element set in before and after content.<\\/li>\\n<li>Fix: Modals created using the Formidable Bootstrap Modal add on were not working as expected with AJAX Pagination.<\\/li>\\n<li>Fix: The third step to set up table view columns was being skipped when creating a new Table View.<\\/li>\\n<\\/ul>\\n<h4>v5.3.1 - August 29, 2022<\\/h4>\\n<ul>\\n<li>New: Improved the accessibility of the new view pop up. Hitting the enter key when entering a view name will now submit the form instead of requiring a button click. Tab indexing has been improved, important inputs will automatically gain focus, and pauses have been added between titles and descriptions.<\\/li>\\n<li>New: Updated deprecated code in the Views Elementor widget for better compatibility with new versions of Elementor.<\\/li>\\n<li>Fix: Grid and table view styles were not automatically included in Formidable CSS without saving the style manager first.<\\/li>\\n<li>Fix: Images in the visual view preview were stretching. The image\'s ratio will now be maintained in the preview.<\\/li>\\n<\\/ul>\\n<h4>v5.3 - June 22, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new AJAX Pagination setting to views, allowing for pagination without reloading the entire page and the new Infinite Scroll option.<\\/li>\\n<li>Fix: Entries would not appear when sorted by post title when no post was associated with the entry.<\\/li>\\n<li>Fix: Some items were not being displayed and other items were appearing twice when the page_size value was not divisible by the limit value.<\\/li>\\n<\\/ul>\\n<h4>v5.1.05 - February 23, 2022<\\/h4>\\n<ul>\\n<li>New: Grid views now support 2\\/3 and 1\\/3 layout options.<\\/li>\\n<li>Fix: Deleting a nested grid row would sometimes trigger an error, making it impossible to delete the row.<\\/li>\\n<li>Fix: Some custom CSS rules on h1 tags were causing the visual view editor to shift underneath the sidebar, making the editor impossible to use.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-views\\/formidable-views.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"174006\":{\"title\":\"WooCommerce\",\"name\":\"WooCommerce\",\"display_name\":\"WooCommerce\",\"slug\":\"woocommerce\",\"version\":\"1.11\",\"new_version\":\"1.11\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-woocommerce\\/formidable-woocommerce-1.11.zip\"],\"excerpt\":\"Are your WooCommerce product forms too basic? Add custom fields to a product form and collect more data when it is added to the cart.\",\"id\":174006,\"released\":\"2016-01-19 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-woocommerce\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/woocommerce\\/\",\"changelog\":\"\",\"plugin\":\"formidable-woocommerce\\/formidable-woocommerce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"169998\":{\"title\":\"WP Multilingual\",\"name\":\"WP Multilingual\",\"display_name\":\"WP Multilingual\",\"slug\":\"wp-multilingual\",\"version\":\"1.12\",\"new_version\":\"1.12\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-wpml\\/formidable-wpml-1.12.zip\"],\"excerpt\":\"Translate your forms into multiple languages using the Formidable-integrated WPML plugin.\",\"id\":169998,\"released\":\"2013-04-29 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-multi-language\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/wp-multilingual\\/\",\"changelog\":\"<h4>v1.12 - August 8, 2022<\\/h4>\\n<ul>\\n<li>New: Translations are now copied when a field or form is duplicated.<\\/li>\\n<li>New: Confirmation field validation messages can now be translated.<\\/li>\\n<li>Fix: Placeholders for Lookup dropdowns were not translating.<\\/li>\\n<li>Fix: Updated translations were not properly updating.<\\/li>\\n<\\/ul>\\n<h4>v1.11 - March 25, 2022<\\/h4>\\n<ul>\\n<li>Fix: Likert column headings were not translating properly.<\\/li>\\n<li>Fix: Incorrect and occasionally duplicate field translation options were appearing on translation pages.<\\/li>\\n<li>Fix: Formidable was appearing as an option in the WPML item dropdown, and has been removed.<\\/li>\\n<\\/ul>\\n<h4>v1.10 - July 29, 2021<\\/h4>\\n<ul>\\n<li>New: Placeholders can now be translated for credit card, address, and name fields.<\\/li>\\n<li>New: Options can now be translated for radio, checkbox, and dropdown fields inside of repeaters.<\\/li>\\n<li>Fix: Translations were not properly getting saved if the target language contained an underscore.<\\/li>\\n<\\/ul>\\n<h4>v1.09 - February 25, 2021<\\/h4>\\n<ul>\\n<li>New: Products are now translatable.<\\/li>\\n<li>New: Translations are now sorted by field order in settings.<\\/li>\\n<li>Fix: PHP8 was frequently logging a deprecation warning.<\\/li>\\n<\\/ul>\\n<h4>v1.06 - April 4, 2019<\\/h4>\\n<ul>\\n<li>Switch back to using separate values by default for checkboxes, radio, and dropdown fields<\\/li>\\n<\\/ul>\\n<h4>v1.04 - October 25th, 2016<\\/h4>\\n<ul>\\n<li>Allow translation of Add\\/Remove buttons<\\/li>\\n<li>Replace some deprecated WPML function calls and constants<\\/li>\\n<li>Make sure wpml strings are updated when form is updated<\\/li>\\n<li>Do not translate default value for all field types<\\/li>\\n<li>Make sure incorrect field message is translated with ajax submit<\\/li>\\n<\\/ul>\\n<h4>v1.03.03 - March 28, 2016<\\/h4>\\n<ul>\\n<li>Send the language in the ajax url differently to prevent 404s during ajax calls. This should help with duplicate submissions.<\\/li>\\n<li>Prevent a license key from being saved for another plugin<\\/li>\\n<\\/ul>\\n<h4>v1.03.02<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<li>Fix errors when Formidable or WPML are deactivated<\\/li>\\n<li>Include the current language during ajax calls<\\/li>\\n<li>Force an English start language for strings for v2.2.6 of the WPML strings plugin<\\/li>\\n<li>Fix the issue with the default language in WPML being set different than the string language<\\/li>\\n<li>If values in the form settings page changed, update them when going to the translation settings<\\/li>\\n<li>Make sure the \\\"previous\\\" label is translatable when drafts are not enabled<\\/li>\\n<li>Don\'t show strings for inactive languages<\\/li>\\n<li>Translate fields in repeating sections<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-wpml\\/formidable-wpml.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"},\"170645\":{\"title\":\"Zapier\",\"name\":\"Zapier\",\"display_name\":\"Zapier\",\"slug\":\"zapier\",\"version\":\"2.01\",\"new_version\":\"2.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-zapier\\/formidable-zapier-2.01.zip\"],\"excerpt\":\"Connect with hundreds of applications through Zapier. Automatically insert a Google spreadsheet row, tweet, or upload to Dropbox.\",\"id\":170645,\"released\":\"2014-06-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-zapier\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/zapier\\/\",\"changelog\":\"<h4>v2.0 - September 14, 2020<\\/h4>\\n<ul>\\n<li>This update requires action. After updating, click the link to migrate the old settings. <strong>Zaps will not be triggered after updating until this is completed.<\\/strong><\\/li>\\n<li>New: Move Zapier settings to form actions. This allows for conditional logic and form action automation to be used from the Formidable end.<\\/li>\\n<li>New: Better logging for more info for both incoming and outgoing API calls for easier debugging.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - September 14, 2020<\\/h4>\\n<p>Fix: Javascript error showing when migration was started<\\/p>\\n<h4>v1.06 - February 6, 2019<\\/h4>\\n<ul>\\n<li>Add a new fallback for authentication with the API key in the url. When the API key continues to say it is missing, add add_filter( \'frm_zap_url_auth\', \'__return_true\' ); in the theme functions.php.<br \\/>\\nThen use this url in Zapier:<br \\/>\\nhttps:\\/\\/yoursite.com\\/API-KEY-GOES-HERE\\/\\n<\\/li>\\n<li>New: Add frm_zap_sent hook to run after an entry is sent to Zapier<\\/li>\\n<li>Fix: Don\'t send draft entries to Zapier<\\/li>\\n<li>Added automation to release new versions<\\/li>\\n<\\/ul>\\n<h4>v1.05 - July 31, 2018<\\/h4>\\n<ul>\\n<li>New: Add frmzap_entry_array filter to customize the entry values sent to Zapier<\\/li>\\n<li>New: Add logging of Zapier responses into the Logs addon<\\/li>\\n<li>Fix: Prevent a blank response when fetching the list of forms. This was happening on some sites with a lot of forms<\\/li>\\n<\\/ul>\\n<h4>v1.04 - July 31, 2017<\\/h4>\\n<p>Fix a conflict with API keys between the Zapier and API addons on a multisite network. This solves the issue with the incorrect API key error message in Zapier.<\\/p>\\n\",\"plugin\":\"formidable-zapier\\/formidable-zapier.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\"}}\";s:7:\"version\";s:5:\"5.5.5\";}', 'no');
