iv>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/unveiledmedia/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/5ca0d59318ee91c7fd792473ea17d372?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/5ca0d59318ee91c7fd792473ea17d372?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/unveiledmedia/\" class=\"reviewer-name\">unveiledmedia</a> le <span class=\"review-date\">décembre 14, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">I tried maybe 10 or more form plugins including all the most popular ones and had almost given up on my search before running into this. I needed a significant feature set including registering users, carrying data from form to form, exporting to Google Sheets, doing complex conditionals and calculations in the live form, and this was the only plugin that had everything I needed.\n\nThey have great documentation and their support team is very helpful as well. Can\'t recommend highly enough.\n\nMy only complaint is that the form builder can really get bogged down on larger forms. I have tried Ajax mode and that didn\'t help. But usually just closing it and opening again usually fixes it for me. Or using Edge instead of Chrome.</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Forms plugin I like it!!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/umarbluemoon/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/f902c98cac8cdfaabaa38aeedd9f4dbb?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/f902c98cac8cdfaabaa38aeedd9f4dbb?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/umarbluemoon/\" class=\"reviewer-name\">umarbluemoon</a> le <span class=\"review-date\">décembre 11, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">Formidable forms plugin -It helps to collect user activity details for better tracking.</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Easy and clean</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/ulisees/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/22f2eea2bd2b1ebaec14d6fa227dfc15?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/22f2eea2bd2b1ebaec14d6fa227dfc15?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/ulisees/\" class=\"reviewer-name\">ulisees</a> le <span class=\"review-date\">décembre 9, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">Thank you devs, this plugin works great with my page!</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great form</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/matthijsbrightonline/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/120765587c04e1cb9a94a7bfc768d661?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/120765587c04e1cb9a94a7bfc768d661?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/matthijsbrightonline/\" class=\"reviewer-name\">matthijsbrightonline</a> le <span class=\"review-date\">décembre 7, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">Every time I work with Formidable Pro i love it that the interface and the final results are also in great form :-)\n\nBest Form plugin there is! </div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great form app</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/vesstally/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/5ddd2fe58f79f1b01766cc56937cc2d9?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/5ddd2fe58f79f1b01766cc56937cc2d9?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/vesstally/\" class=\"reviewer-name\">vesstally</a> le <span class=\"review-date\">décembre 2, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">Easy to use!!! I have tried different alternatives. Finally, I have chosen it!</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">I stopped looking when I found Formidable!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/amciotola/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/daceefcbe9d4799db044be843ed24fdc?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/daceefcbe9d4799db044be843ed24fdc?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/amciotola/\" class=\"reviewer-name\">amciotola</a> le <span class=\"review-date\">novembre 29, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">This plug-in is so versatile that there is no other one that compares to the power of this one! Steph and her team only make it better and better with each release. One of the best things about this is that learning the basics and even more moderate skill set is just so easy to do! I\'ve taken to really put the time into learning how it worked and with this plug-in alone I was able to build not only a customer portal for a small business but also build an employee portal with the ability to keep functions separate from each. Unfortunately, the business has since closed but I\'ve been thinking of putting the site up as a sample of the work I\'ve done and more than half of it would not have been possible with this cool plug-in!</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">LEARNING CURVE MORE STEEP, BUT ...</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/awedemeyer/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/49e77613ca644ef832f4ad7eb3c907aa?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/49e77613ca644ef832f4ad7eb3c907aa?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/awedemeyer/\" class=\"reviewer-name\">awedemeyer</a> le <span class=\"review-date\">novembre 29, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">At the beginning i wished to have a somehow \"nicer\" interface. Didn´t feel really comfortable with the UI. But it is a really powerful tool that works very consistently so after - maybe a little bit more time compared to other tools - you really don\'t wish to miss it!</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">THE BEST OF THEM ALL!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/tangolara/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/b32c9c08262d2e6077b7eb3c8759d075?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/b32c9c08262d2e6077b7eb3c8759d075?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/tangolara/\" class=\"reviewer-name\">tangolara</a> le <span class=\"review-date\">novembre 29, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">Formidable Forms has it all!  I am an avid user of Formidable Forms and other popular form builders.  I have to say, when it comes to ease of use, functionality, and options, I prefer Formidable Forms above them all! \n\nI usually have to purchase other add-ons at a premium price for the other form builders, and the add-ons typically slow down my site. \n\nFormidable includes the add-ons I use most in my subscription, so I\'m not wasting hundreds of dollars on slow plugins. \n\nAlso, I\'ve never had a problem with Formidable Forms slowing down my site. \n\nI\'m very pleased with Formidable Forms!  Thanks so much for all your hard work and effort!</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Deese Marketing Association</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/johndeese/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/03470917ae4b86ced1525f9b5b9cd7ad?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/03470917ae4b86ced1525f9b5b9cd7ad?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/johndeese/\" class=\"reviewer-name\">johndeese</a> le <span class=\"review-date\">novembre 28, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">I am glad that we chose formidable as our document handling process integrated into our business. Ever since my business has grown change to meet our customers demand so have formidable. Keep up the good work.</div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Best Forms Plugin Ever</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 sur 5 étoiles\" data-title-template=\"%s sur 5 étoiles\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Par <a href=\"https://profiles.wordpress.org/crowesam/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/5cc69f8c710bfdf4e13d5994e139b43a?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/5cc69f8c710bfdf4e13d5994e139b43a?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/crowesam/\" class=\"reviewer-name\">crowesam</a> le <span class=\"review-date\">novembre 22, 2022</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\">I\'ve used this plugin for over ten years and it just keeps getting better!</div>\n</div>\n\";}}', 'no'),
