(142, 1, '2022-12-21 14:12:44', '2022-12-21 14:12:44', 'Avec le <strong>meuble TV TRESCA</strong>, on donne à son salon un style industriel tout en finesse !\r\n\r\nSi la structure en panneaux de fibres de bois noirs et le <strong>piètement en métal</strong> assorti évoquent l\'esprit indus\', leur aspect lissé et leur légèreté apportent de l\'élégance à cette tendance déco brute. Le piètement fin donne de la hauteur au modèle TRESCA pour un espace TV qui n\'allourdira pas votre séjour. Les portes en panneaux de fibres de bois décor <strong>chêne</strong> créent un joli contraste avec cette structure métallique. Elles ajoutent la touche chaleureuse et authentique qui fait tout le charme de ce meuble.\r\n\r\nCe <strong>meuble TV industriel</strong> est un concentré de praticité. Avec ses <strong>deux espaces de rangement fermés</strong> et son <strong>tiroir</strong>, il est parfaitement optimisé pour garder le coin télé rangé. La niche centrale, équipée d\'un <strong>passe-câble</strong>, accueillera la box, le décodeur ou la console de jeux. Grâce à son <strong>plateau de 140 cm de long</strong>, le meuble TV TRESCA possède toute la place nécessaire pour un grand écran télé.\r\n\r\nLivré prêt à monter.', 'Meuble TV industriel bois et métal L140 cm TRESCA', '<ul>\r\n 	<li>Dimensions totales: L140 x P40 x H45 cm</li>\r\n 	<li>Hauteur des pieds: 15 cm</li>\r\n 	<li>Matière: panneaux de fibres de bois papier déco noirs et chêne et métal</li>\r\n 	<li>Dimensions du colis: L150 x P15 x H47 cm</li>\r\n 	<li>Poids du colis: 9kg</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'meuble-tv-industriel-bois-et-metal-l140-cm-tresca', '', '', '2022-12-21 14:12:44', '2022-12-21 14:12:44', '', 0, 'https://thomas-spinec.students-laplateforme.io/mycms/?post_type=product&#038;p=142', 0, 'product', '', 0),
