(147, 1, '2022-12-21 14:20:41', '2022-12-21 14:20:41', 'Ajoutez une touche industrielle à votre salon avec cet élégant meuble TV design ! Sa construction en bois d\'ingénierie repose sur un piétement en acier robuste - une garantie de durabilité et de stabilité. Les grands tiroirs et les armoires à portes intégrés offrent, de leur côté, suffisamment d\'espace pour tous vos équipements audiovisuels. On craque pour le design de cette banquette télé hors du commun. La couleur du bois clair et le métal noir créent un look tendance tandis que sa forme simple confère à ce meuble un caractère minimaliste. Un meuble télé à la fois design et fonctionnel qui ne pourra pas passer inaperçu.', 'Meuble TV design effet bois clair noir', 'Dimensions (cm) : H44 x L39 x P160\r\n\r\nA monter soi-même', 'publish', 'open', 'closed', '', 'meuble-tv-design-effet-bois-clair-noir', '', '', '2022-12-21 14:20:41', '2022-12-21 14:20:41', '', 0, 'https://thomas-spinec.students-laplateforme.io/mycms/?post_type=product&#038;p=147', 0, 'product', '', 0),
