(149, 1, '2022-12-21 14:34:35', '2022-12-21 14:34:35', 'Ce lampadaire Led d\'intérieur est en métal noir mat avec des douilles en laiton. Cette lampe de sol fonctionne avec 3 ampoules E27 40 W maximum, non fournies ce qui vous laisse le choix de l\'esthétique, de la température de couleur et de l\'intensité lumineuse en fonction de vos envie ou de vos goûts.Les avantages esthétiques.\r\nVous aimerez les lignes sobres de ce lampadaire conçu par la maison Lucide, spécialiste belge du luminaire depuis plus de 25 ans, qui se mariera parfaitement avec une décoration de style industriel. Les douilles en laiton rajoutent une touche de sophistication à l\'esthétique minimaliste du lampadaire. Ce luminaire éclairera efficacement votre pièce à vivre. Avec ses dimensions imposantes et ses 3 points lumineux, il conviendra parfaitement dans votre salon ou le coin lecture de votre bibliothèque ainsi que dans une entrée. Afin de renforcer l\'esthétique industrielle de ce lampadaire nous vous conseillons d\'utiliser des ampoules à filament.', 'Lampadaire Led H120cm', '<ul class=\"pl-0 list-unstyled\" data-v-0f3d1897=\"\">\r\n 	<li data-v-0f3d1897=\"\"><span data-v-0f3d1897=\"\">Dimensions (cm): </span><span data-v-0f3d1897=\"\">H120 x PR22</span></li>\r\n 	<li data-v-0f3d1897=\"\">Diamètre du produit : 0 cm</li>\r\n 	<li data-v-0f3d1897=\"\">Couleur principale : Noir</li>\r\n 	<li data-v-0f3d1897=\"\">Matière principale : Métal</li>\r\n 	<li data-v-0f3d1897=\"\">Matière de la structure : Métal</li>\r\n 	<li data-v-0f3d1897=\"\">Système d\'allumage : Avec interrupteur</li>\r\n 	<li data-v-0f3d1897=\"\">Puissance maximale watt : 40 w</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'lampadaire-led-h120cm', '', '', '2022-12-21 14:34:35', '2022-12-21 14:34:35', '', 0, 'https://thomas-spinec.students-laplateforme.io/mycms/?post_type=product&#038;p=149', 0, 'product', '', 0),
