(151, 1, '2022-12-21 14:43:39', '2022-12-21 14:43:39', '<h2>Table de salle à manger en bois massif AMAZONAS 200cm acacia métal noir bord d\'arbre</h2>\r\n<h2>Cette table de salle à manger deviendra la pièce préférée de votre maison</h2>\r\n<p align=\"justify\">La symbiose parfaite entre un magnifique produit naturel et un métal massif vous attend ici. La grande table à manger de notre série AMAZONAS est un bijou unique en bois d\'acacia soigneusement verni. Le plateau de table en bois est interrompu en son milieu par une plaque décorative en métal noir mat. Celle-ci s\'harmonise parfaitement avec les pieds métalliques massifs en forme de X sur lesquels repose le plateau de table. Point fort particulier, les bords de la table ont été travaillés de manière à créer le caractère original et l\'impression naturelle d\'une grande tranche d\'acacia.</p>\r\n\r\n<h2>Une symbiose réussie</h2>\r\n<p align=\"justify\">Le traitement avec un vernis à bois confère au bois d\'acacia une teinte brune particulièrement chaude, qui dégage chaleur et convivialité. Le métal noir forme un contraste habile et donne à la table un air de chic industriel. Avec cette table, vous êtes particulièrement libre de choisir le reste de l\'ambiance : que ce soit des meubles en bois, des lampes en métal ou des chaises en cuir noir et brun, la table se combine toujours à merveille et devient l\'accroche-regard dans chaque salle à manger.</p>\r\n\r\n\r\n<hr />\r\n\r\n<strong>Remarque :</strong> comme il s\'agit d\'un produit naturel, chaque table est absolument unique. Des irrégularités, des trous de noeuds charismatiques, des fissures ou des différences de dimensions sont possibles et créent une originalité qui fait le charme du bois massif. Les fissures existantes sont encore reliées et stabilisées pendant le processus de fabrication par des pièces de jonction du même bois. Il est donc possible que des différences de couleur apparaissent. Il ne s\'agit en aucun cas d\'un motif de réclamation.', 'Table de salle à manger en bois massif', '<div class=\"attrgroup\">\r\n<div class=\"subtitle\">Couleur</div>\r\n<ul class=\"attributeslist\">\r\n 	<li class=\"aA11\">Plateau : naturel</li>\r\n 	<li class=\"aA20\">Pieds : noir</li>\r\n</ul>\r\n</div>\r\n<div class=\"attrgroup\">\r\n<div class=\"subtitle\">Matériau</div>\r\n<ul class=\"attributeslist\">\r\n 	<li class=\"aAM01\">Plateau : bois d\'acacia laqué</li>\r\n 	<li class=\"aAM02\">Pieds : métal</li>\r\n</ul>\r\n</div>', 'publish', 'open', 'closed', '', 'table-de-salle-a-manger-en-bois-massif-amazonas-200cm-acacia-metal-noir-bord-darbre', '', '', '2022-12-21 15:55:25', '2022-12-21 15:55:25', '', 0, 'https://thomas-spinec.students-laplateforme.io/mycms/?post_type=product&#038;p=151', 0, 'product', '', 0),
