(154, 1, '2022-12-21 14:51:33', '2022-12-21 14:51:33', 'La table de jardin DCB Garden Stockholm est parfaite pour recevoir de la famille ou des amis pour profiter d’un bon repas en extérieur. Avec un <strong>plateau de 96 x 200 cm</strong> pouvant être agrandi à l’aide d’une <strong>rallonge manuelle</strong>, cette table extensible pourra atteindre les <strong>3 m de long</strong> et accueillir confortablement <strong>jusqu’à douze personnes</strong>.\r\n\r\nCette table d’extérieur est entièrement conçue en <strong>aluminium</strong>, un alliage robuste et <strong>naturellement insensible à la rouille</strong>, même sans entretien particulier. Elle revêt une élégante <strong>finition gris anthracite</strong>, ce qui lui permet de s’intégrer facilement dans tout type d’extérieur. Notez enfin que la table Stockholm est <strong>livrée en kit</strong>, à monter soi-même.\r\n\r\nCette table est garantie 2 ans.', 'Table de Jardin Extensible en Aluminium Stockholm 200/300 cm', 'Cette table de jardin extensible possède une rallonge manuelle lui permettant de passer de 2 à 3 m de long. Elle offre donc suffisamment d’espace pour accueillir jusqu’à douze personnes. Le tout est fabriqué en aluminium finition gris anthracite.', 'publish', 'open', 'closed', '', 'table-de-jardin-extensible-en-aluminium-stockholm-200-300-cm', '', '', '2022-12-21 14:51:33', '2022-12-21 14:51:33', '', 0, 'https://thomas-spinec.students-laplateforme.io/mycms/?post_type=product&#038;p=154', 0, 'product', '', 0),
