(158, 1, '2022-12-21 14:58:54', '2022-12-21 14:58:54', 'Le <a href=\"https://www.monamenagementjardin.fr/mobilier-jardin/salon-de-jardin.html\"><strong>salon de jardin</strong></a> Isa en résine tressée demi ronde grise de chez DCB Garden aménage votre jardin avec sobriété et confort.\r\n\r\nCet élégant salon est composé de 4 pièces :\r\n<ul>\r\n 	<li>1 canapé 3 places de 160 x 80 x 70 cm (l,l,h), hauteur d\'assise : 30 cm, avec son coussin d’assise de 8 cm d\'épaisseur et ses trois coussins de dossier écrus en polyester</li>\r\n 	<li>2 fauteuils de 85 x 76 x 70 cm (l,l,h), hauteur d\'assise : 30 cm avec, chacun un coussin d’assise de 8 cm d\'épaisseur et un coussin de dossier en polyester écru</li>\r\n 	<li>une table basse de 102 x 60 30 cm (l,l,h) équipée d’un plateau en verre transparent.</li>\r\n</ul>\r\nLes coussins de votre ensemble sont déhoussables.\r\n\r\nPour une meilleure tenue dans le temps votre salon est monté sur une structure en aluminium. Votre ensemble de jardin est garanti 2 ans', 'Salon de Jardin Résine Tressée 1/2 Ronde Grise Isa 4 Pièces', 'Le salon de jardin original et contemporain comprend un canapé, deux fauteuils et une table basse. Le salon de jardin est en résine tressée, un matériau esthétique, résistant et qui ne demande pas d\'entretien.', 'publish', 'open', 'closed', '', 'salon-de-jardin-resine-tressee-1-2-ronde-grise-isa-4-pieces', '', '', '2022-12-21 14:58:54', '2022-12-21 14:58:54', '', 0, 'https://thomas-spinec.students-laplateforme.io/mycms/?post_type=product&#038;p=158', 0, 'product', '', 0),
